INSERT INTO `aboutus` (`id`, `aboutus_description_th`, `aboutus_description_en`, `created_at`, `updated_at`) VALUES
(1, '<p>ยินดีต้อนรับทุกท่านสู่เว็บไซต์ตลาดออนไลน์ <a href="http://www.dgtfarm.com">www.dgtfarm.com</a> เรามีจุดประสงค์ในการจัดทำขึ้นมาเพื่อให้เกษตรกรที่อยู่ในพื้นที่ห่างไกลหรืออยู่ใกล้กัน ได้มารวมกันในตลาดแห่งนี้ เพื่อให้เกษตรกรได้นำสินค้าที่มีจุดเด่นของตัวเองนำมาโพสต์เสนอลูกค้าในตลาดdgtfarm เพื่อดึงดูดผู้ซื้อให้มีความสนใจเข้ามาเลือกซื้อสินค้าให้ได้สินค้าดั่งใจหวังตรงความต้องการ<br />\r\nซึ่งตลาดdgtfarm ได้มีการเปิดตลาดในการวางขายสินค้าอยู่ 3 ตลาด ดังนี้</p>\r\n\r\n<p>1.ตลาดเกษตรอินทรีย์และตลาดสีเขียว เป็นตลาดที่เกษตรกรต้องดูแลสินค้าเกษตรเหมือนไข่ในหิน เพื่อให้สินค้าที่นำมาวางขายในตลาดไม่มีสารพิษสารเคมีปนเปื้อน ทำให้ผู้บริโภคที่ได้รับประทานเข้าไปรับคุณค่าประโยชน์อย่างเต็มที่และยังทำให้ผู้บริโภคยืดระยะเวลาในการหายใจและการใช้ชีวิตในโลกนี้เพิ่มขึ้นอีกด้วย</p>\r\n\r\n<p>2.ตลาดสินค้าเกษตรแปลงใหญ่เป็นตลาดที่กระทรวงเกษตรและสหกรณ์คอยหนุนหลังหรือให้การสนับสนุนช่วยเหลือกลุ่มเกษตรที่มีพื้นที่ผืนน้อยในการทำมาหากินเข้ามารวมตัวกันหลายๆคนหลายๆครอบครัว จนกลายมาเป็นกลุ่มเกษตรแปลงใหญ่ถึงใหญ่มาก</p>\r\n\r\n<p>3.ตลาดสินค้า QR Trace เป็นเกษตรกรผู้ผลิตสินค้าได้ผ่านการยื่นขอรับเครื่องหมายรับรองการผลิตและสามารถสมัครใช้งานระบบ QR Trace ในการตรวจสอบสินค้าเกษตรได้ การติด QR Code กับสินค้าทำให้สินค้าที่ไปวางขายในตลาดมีความน่าเชื่อถือ ดูดีมีราคาและชาติตระกูลที่ดี</p>\r\n\r\n<p>ตลาดออนไลน์dgtfarm มีหน้าที่เป็นตัวกลางคอยเชื่อมติดต่อให้ผู้ซื้อผู้ขายที่มีใจตรงกันมีทัศนคติเดียวกันได้เจรจาตกลงปลงใจร่วมคิดร่วมทำธุรกิจการค้าร่วมกัน จนทำให้เกิดความสัมพันธ์กันระหว่างเกษตรกรผู้ผลิตกับผู้ประกอบการค้าและผู้บริโภคที่ต้องการซื้อสินค้าที่ดีมีคุณภาพ ทำให้ตลาดออนไลน์ dgtfarm ช่วยลดต้นทุนค่าใช้จ่ายในการเดินทางขึ้นรถลงเรือ รถไฟเครื่องบินและเวลาในการเจอกัน จึงทำให้ได้รับผลกำไรและผลตอบแทนแบบเต็มเม็ดเต็มหน่วย นอกจากนี้ยังมีทีมงานเกษตรดิจิทัลคอยสนับสนุนและช่วยดูแลประสานงานเป็นสื่อกลางตัวแทนยื่นมือให้คำแนะนำระหว่างเกษตรกรผู้ผลิตกับ<br />\r\nผู้ประกอบการค้าและผู้บริโภค ให้มีความสัมพันธ์สะดวกในการติดต่อทางธุรกิจ หากเกิดอุปสรรคปัญหาในการซื้อขายด้านต่างๆ ทางทีมงานเกษตรดิจิทัลยินดีที่จะช่วยเหลือให้คำแนะนำการแก้ไขปัญหาอุปสรรคต่างๆโดยไม่คิดค่าใช้จ่ายใดๆ เลยแม้แต่นิดเดียว เพียงขอให้ทุกคนมีความสุข มีความมั่งคั่ง มั่นคงและยั่งยืน <a name="_GoBack"></a></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; สนับสนุนโดย&nbsp;&nbsp;&nbsp; ศูนย์เทคโนโลยีสารสนเทศและการสื่อสาร&nbsp;&nbsp;<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; สำนักงานมาตรฐานสินค้าเกษตรและอาหารแห่งชาติ (มกอช.)</p>\r\n', '<p>ยินดีต้อนรับทุกท่านสู่เว็บไซต์ตลาดออนไลน์ <a href="http://www.dgtfarm.com">www.dgtfarm.com</a> เรามีจุดประสงค์ในการจัดทำขึ้นมาเพื่อให้เกษตรกรที่อยู่ในพื้นที่ห่างไกลหรืออยู่ใกล้กัน ได้มารวมกันในตลาดแห่งนี้ เพื่อให้เกษตรกรได้นำสินค้าที่มีจุดเด่นของตัวเองนำมาโพสต์เสนอลูกค้าในตลาดdgtfarm เพื่อดึงดูดผู้ซื้อให้มีความสนใจเข้ามาเลือกซื้อสินค้าให้ได้สินค้าดั่งใจหวังตรงความต้องการ<br />\r\nซึ่งตลาดdgtfarm ได้มีการเปิดตลาดในการวางขายสินค้าอยู่ 3 ตลาด ดังนี้</p>\r\n\r\n<p>1.ตลาดเกษตรอินทรีย์และตลาดสีเขียว เป็นตลาดที่เกษตรกรต้องดูแลสินค้าเกษตรเหมือนไข่ในหิน เพื่อให้สินค้าที่นำมาวางขายในตลาดไม่มีสารพิษสารเคมีปนเปื้อน ทำให้ผู้บริโภคที่ได้รับประทานเข้าไปรับคุณค่าประโยชน์อย่างเต็มที่และยังทำให้ผู้บริโภคยืดระยะเวลาในการหายใจและการใช้ชีวิตในโลกนี้เพิ่มขึ้นอีกด้วย</p>\r\n\r\n<p>2.ตลาดสินค้าเกษตรแปลงใหญ่เป็นตลาดที่กระทรวงเกษตรและสหกรณ์คอยหนุนหลังหรือให้การสนับสนุนช่วยเหลือกลุ่มเกษตรที่มีพื้นที่ผืนน้อยในการทำมาหากินเข้ามารวมตัวกันหลายๆคนหลายๆครอบครัว จนกลายมาเป็นกลุ