(1, '<p>สำนักงานมาตรฐานสินค้าเกษตรและอาหารแห่งชาติ (มกอช.)<br />\r\nที่ตั้ง : เลขที่ 50 ถนนพหลโยธิน แขวงลาดยาว เขตจตุจักร<br />\r\nกรุงเทพมหานคร 10900&nbsp;<br />\r\nโทรศัพท์ +662- 561-2277&nbsp;<br />\r\nข้อเสนอแนะติดต่อ itc@acfs.go.th</p>\r\n', '<p>National Bureau of Agricultural Commodity and Food Standards<br />\r\n(ACFS)<br />\r\nAddress : 50 Phaholyothin Road, Ladyao Chatuchak Bangkok<br />\r\nThailand 10900<br />\r\nTel.+662- 561-2277<br />\r\nE-Mail :&nbsp; itc@acfs.go.th</p>\r\n', '13.75633100', '100.50176500', '2016-11-04 02:39:59', '2016-12-13 20:51:30');
