(3, 'ศันสนีย์', 'แตงโสภา', 'pinamlpcom2@gmail.com', '02-222-2222', '', 'ขายไม่ได้', 'ลงขายไม่ได้คะ', '2016-11-24 21:41:43', '2016-11-24 21:41:43'),
(4, 'บุญไชย', 'ปัญจสินชัย', 'Boonchai9959@gmail.com', '081 4666583', '', 'ต้องการสมัครใช้งานตลาดออนไลน์', 'ผมไม่สามารถสมัครใช้งานตลาดออนไลน์ผ่าน www:DGTFarm.comได้เนื่องด้วย ตรงช่อง ตำบล และอำเภอ ไม่สามารถป้อนข้อมูลได้\r\nขอคำแนะนำว่าต้องทำอย่างไรเพื่อให้สมัครได้ด้วยครับ', '2017-04-11 04:03:15', '2017-04-11 04:03:15'),
(5, 'นลินี', 'ภมรสุขนิรันดิ์', 'pnainee@hotmail.com', '0892475899', '', 'สนใจเรื่อง QR Code', 'สนใจเรื่อง QR Code สินค้าเกษตร ต้องทำอย่างไรคะ รบกวนแนะนำค่ะ เป็นสินค้าประเภทเห็ดหลินจือและเห็ดถังเช่าสีทอง ', '2017-05-20 05:50:34', '2017-05-20 05:50:34'),
(6, 'Chuchart', 'Ketkaew', 'cjk2549@gmail.com', '66818649107', '', 'สมัครสมาชิกแล้วแต่ไม่สามารถ ล็อคอินได้', 'ขอความช่วยเหลือในการล็อคอินครับ', '2017-07-02 17:02:21', '2017-07-02 17:02:21'),
(7, 'ไมตรี', 'พันธุลาภ', 'x-size-th@hotmail.com', '0882783773', '', 'สมัครสมาชิก แล้ว แต่เข้าไม่ได้', 'login ไม่ได้ ให้ข้อมูลถูกต้อง แต่ เว็บไม่ให้เข้า\r\nมี mail ส่งมาว่าเป็นสมาชิก แล้ว แต่ก็ยังเข้าไม่ได้\r\nเปลี่ยน รหัสเข้าใหม่ ก็ไม่ให้เปลี่ยน\r\nต้องทำอย่างไร', '2017-07-21 02:18:54', '2017-07-21 02:18:54'),
(8, 'กมลพร', 'ห่านทอง', 'Pla-2516@hotmail.com', '0847681993', '', 'การเข้ามาขายสินค้า', 'อยากได้รายละเอียด  ถ้าเราจะนำสินค้าเกษตรเข้ามาจำหน่าย ต้องทำยังไงบ้าง ตอนนี้ปลูกผักกะเฉด ผักสลัด ผักบุ้งจีน กล้วยน้ำว้า แฟง ต้นอ่อนทานตะวัน ขอคำเนะนำด้วยค่ะ', '2017-08-16 04:09:30', '2017-08-16 04:09:30'),
(9, 'กมลพร ', 'ห่านทอง', 'Pla-2516@hotmail.com', '847681993', '', 'สอบถามเรื่องการเข้ามาเป็นสมาชิก', 'สอบถามว่าเป็นเกษตรกร  ปลูกผัก เลี้ยงปลา จะเอาของเข้ามาขายได้ยังไงค่ะ', '2017-08-18 01:29:44', '2017-08-18 01:29:44'),
(10, 'จันทร์จิรา', 'แก้วบัว', 'janjiping@gmail.com', '0879372384', '', 'เข้าระบบไม่ได้', 'สวัสดีค่ะ\r\nเมื่อเช้าเวลา 8.48 น. ทาง DGTfarm โทรศัพท์มายืนยันและจะปลดล็อคการเข้าระบบ \r\nตอนนี้ยังล็อคอินเข้าระบบยังไม่ได้เลยค่ะ ต้องทำอย่างไรบ้างค่ะ\r\n', '2017-09-20 03:46:59', '2017-09-20 03:46:59'),
(11, 'นาย ประทุม', 'จิณเสน', 'pratoom@e-refillcall.com', '0865137777', '', 'ขอคำแนะนำและการศึกษาดูงาน', 'จัดหวัดน่านได้รับงบประมาณจัด สร้างศูนย์กระจ่ายสินค้านวัตกรรมเกษตรปลอดภัยประชารัฐ ชึ่งจะบริหารโดยบริษัทประชารัฐรีกสามัคคีน่าน(วิสาหกิจเพื่อสังคม)จำกัด เพื่อส่งเสริมการผลิตและรวบรวมสินค้าเกษตรปลอดภัยสู่ตลาด ทั้งในและนอกจังหวัด', '2017-10-06 19:17:29', '2017-10-06 19:17:29'),
(12, 'ศจีรัตน์ ', 'ระวิ', 'sajeeratrawi@gmail.com', '0903289424', '', 'ขายเห็ดหลินจือ', 'ต้องการแก้ไขเพิ่มเติมข้อมูล', '2017-12-17 04:40:34', '2017-12-17 04:40:34'),
