INSERT INTO `downloaddocuments` (`id`, `downloaddocument_title_th`, `downloaddocument_description_th`, `downloaddocument_title_en`, `downloaddocument_description_en`, `downloaddocument_file`, `sequence`, `created_at`, `updated_at`) VALUES
(1, 'การปฏิบัติทางการเกษตรที่ดีสำหรับฟาร์มปศุสัตว์ (GAP ฟาร์มปศุสัตว์)', '<p>การปฏิบัติทางการเกษตรที่ดีสำหรับฟาร์มปศุสัตว์ (GAP ฟาร์มปศุสัตว์)</p>\r\n', 'การปฏิบัติทางการเกษตรที่ดีสำหรับฟาร์มปศุสัตว์ (GAP ฟาร์มปศุสัตว์)', '<p>การปฏิบัติทางการเกษตรที่ดีสำหรับฟาร์มปศุสัตว์ (GAP ฟาร์มปศุสัตว์)</p>\r\n', 'upload/documents/1479119882/brochure_39.pdf', 999, '2016-11-14 03:38:02', '2016-11-14 03:38:02'),
(2, 'ACFS', '<p>เกี่ยวกับ มกอช.</p>\r\n\r\n<p><img alt="test1" src="http://gomdev.agilethailand.com/upload/files/1479273435_Chrysanthemum.jpg" style="float:right; height:300px; width:400px" /></p>\r\n', 'xx', '<p>wwww</p>\r\n', 'upload/documents/1479273501/Hydrangeas.jpg', 999, '2016-11-15 22:18:21', '2016-11-15 22:18:21'),
(3, 'แบบฟอร์มสมัครใช้งาน QR Trace On Cloud', '', 'Download Form QR Trace On Cloud', '', 'upload/documents/1522644577/New61แบบฟอร์มการสมัครQR-Trace.docx', 1, '2018-04-02 04:49:37', '2018-04-02 04:49:37');
INSERT INTO `faq` (`id`, `faq_question_th`, `faq_answer_th`, `faq_question_en`, `faq_answer_en`, `sequence`, `created_at`, `updated_at`, `faqcategory_id`) VALUES
(1, 'DGTFarm แบ่งตลาดการขายไว้กี่ประเภท?', '<p>แบ่งออกเป็น 3 ตลาดโดยเงื่อนไขที่สินค้าจะวางในตลาดได้ มีดังต่อไปนี้<BR>\n1) ตลาด QR Trace ต้องมีเลขผู้ประกอบการระบบ QR Trace <BR>\n2) ตลาดอินทรีย์ ต้องขายสินค้าที่ได้มาตรฐานเกษตรอินทรีย์ <BR>\n3) ตลาดแปลงใหญ่ คือสินค้าอยู่ในพื้นที่กระทรวงเกษตรและสหกรณ์ส่งเสริมให้ผลิตแบบแปลงใหญ่</p>\n', 'Is account registration required?', '<p>Account registration at&nbsp;<strong>PrepBootstrap</strong>&nbsp;is only required if you will be selling or buying themes. This ensures a valid communication channel for all parties involved in any transactions.</p>\r\n', 999, '2016-11-04 23:12:20', '2016-11-04 23:12:20', 1);
