INSERT INTO `news` (`id`, `news_title_th`, `news_description_th`, `news_title_en`, `news_description_en`, `news_created_at`, `news_place`, `news_tags`, `news_sponsor`, `news_document_file`, `sequence`, `created_at`, `updated_at`) VALUES
(9, 'โครงการจัดอบรมการใช้งานระบบตามสอบสินค้าเกษตรสำหรับผู้ประกอบการขนาดกลางและขนาดเล็ก (QR Trace) ระหว่างวันที่ 7-8 ธันวาคม 2559  ณ โรงแรมโก้ลเด้นซิตี้ จังหวัดระยอง', '<p>สำนักงานมาตรฐานสินค้าเกษตรและอาหารแห่งชาติ จัดอบรมระบบตามสอบสินค้าเกษตรสำหรับผู้ประกอบการขนาดกลางและขนาดเล็ก</p>\r\n\r\n<p>ระหว่างวันที่ 7-8 ธันวาคม 2559 &nbsp;ณ โรงแรมโก้ลเด้นซิตี้ จังหวัดระยอง</p>\r\n\r\n<p><img alt="" src="http://www.acfs.go.th/image/acfs_07-12-59-3.jpg" style="height:242px; width:430px" /></p>\r\n\r\n<p><img alt="" src="http://www.acfs.go.th/image/acfs_07-12-59-7.jpg" style="height:242px; width:430px" /></p>\r\n\r\n<p><img alt="" src="http://www.acfs.go.th/image/acfs_07-12-59-6.jpg" style="height:242px; width:430px" /></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n', 'QR Trace Trainning', '<p>QR Trace Trainning&nbsp;</p>\r\n\r\n<p><img alt="" src="http://www.acfs.go.th/image/acfs_07-12-59-3.jpg" style="height:242px; width:430px" /></p>\r\n\r\n<p><img alt="" src="http://www.acfs.go.th/image/acfs_07-12-59-6.jpg" style="height:242px; width:430px" /></p>\r\n\r\n<p><img alt="" src="http://www.acfs.go.th/image/acfs_07-12-59-6.jpg" style="height:242px; width:430px" /></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n', '2016-12-14', 'ระยอง', '', 'มกอช.', '', 999, '2016-12-14 00:26:44', '2017-12-28 08:52:16'),
(11, '“เกษตรอินทรีย์ยโสธร 2559”', '<p>จังหวัดยโสธร ขอเชิญผู้ประกอบการ เกษตรกร ผู้รักสุขภาพและผู้สนใจเกษตรอินทรีย์ ร่วมชมงาน&hellip;<br />\r\nYasothon Organic Fair 2016 &ldquo;เกษตรอินทรีย์ยโสธร 2559&rdquo;<br />\r\n15 -19 ธันวาคม 2559 ณ สนามหน้าศาลากลางจังหวัดยโสธร</p>\r\n\r\n<p>&ndash; ชมศักยภาพและความก้าวหน้าของเกษตรอินทรีย์ยโสธร<br />\r\n&ndash; เรียนรู้ แลกเปลี่ยนการทำเกษตรอินทรีย์<br />\r\n&ndash; การจัดแสดงสินค้า และจำหน่ายผลิตภัณฑ์เกษตรอินทรีย์<br />\r\n&ndash; การสัมมนาวิชาการเกษตรอินทรีย์</p>\r\n', 'Yasothon Organic Fair 2016', '<p>Yasothon Organic Fair 2016</p>\r\n', '2016-12-15', 'ณ สนามหน้าศาลากลางจังหวัดยโสธร', '', 'จังหวัดยโสธร', 'upload/news/1482998439/10078.jpg', 999, '2016-12-29 01:00:39', '2016-12-29 01:00:39'),
(12, 'โครงการจัดอบรมการใช้งานระบบตามสอบสินค้าเกษตรสำหรับผู้ประกอบการขนาดกลางและขนาดเล็ก (QR Trace) ระหว่างวันที่ 20-21 ธันวาคม 2559 ณ โรงแรมประตูน้ำ จังหวัดขอนแก่น', '<p>สำนักงานมาตรฐานสินค้าเกษตรและอาหารแห่งชาติ จัดอบรมระบบตามสอบสินค้าเกษตรสำหรับผู้ประกอบการขนาดกลางและขนาดเล็ก ระหว่างวันที่ 20-21 ธันวาคม 2559 &nbsp;ณ โรงแรมประตูน้ำ จังหวัดขอนแก่น</p>\r\n\r\n<p>&nbsp;</p>\r\n', 'QR Trace Trainning', '<p>QR Trace Trainning</p>\r\n\r\n<p>&nbsp;</p>\r\n', '2016-12-20', 'โรงแรมประตูน้ำ', '', 'สำนักงานมาตรฐานสินค้าเกษตรและอาหารแห่งชาติ (มกอช.)', 'upload/news/1484541419/S__10903568.jpg', 998, '2016-12-29 01:16:15', '2017-12-28 08:51:45');
