(13, 'โครงการจัดอบรมการใช้งานระบบตามสอบสินค้าเกษตรสำหรับผู้ประกอบการขนาดกลางและขนาดเล็ก (QR Trace) ระหว่างวันที่  9-10 มกราคม 2560 ณ โรงแรมเลอปาร์ค จังหวัดพิษณุโลก', '<p>สำนักงานมาตรฐานสินค้าเกษตรและอาหารแห่งชาติ(มกอช.) จัดอบรมระบบตามสอบสินค้าเกษตรสำหรับผู้ประกอบการขนาดกลางและขนาดเล็ก ระหว่างวันที่ 9-10 มกราคม 2560&nbsp; ณ โรงแรมเลอปาร์ค จังหวัดพิษณุโลก<br />\r\n<img alt="" src="data:image/jpeg;base64," style="height:298px; width:397px" /></p>\r\n\r\n<p>&nbsp;</p>\r\n', 'QR Trace Trainning', '<p>QR Trace Trainning 9-10 January 2016<br />\r\n<img alt="" src="data:image/jpeg;base64," style="height:298px; width:397px" /></p>\r\n\r\n<p>&nbsp;</p>\r\n', '2017-01-09', 'ณ โรงแรมเลอปาร์ค จังหวัดพิษณุโลก', '', 'สำนักงานมาตรฐานสินค้าเกษตรและอาหารแห่งชาติ (มกอช.)', '', 996, '2017-01-19 21:00:02', '2017-12-28 08:51:23');
