(14, 'Happy New Year 2017', '<p>Happy New Year 2017 ศูนย์เทคโนโลยีสารสนเทศและการสื่อสาร(ศทส.) ร่วมจับของขวัญปีใหม่<br />\r\n<img alt="" src="data:image/jpeg;base64,', 'Happy New Year 2017', '<p>Happy New Year 2017</p>\r\n', '2017-01-17', 'ศูนย์เทคโนโลยีสารสนเทศและการสื่อสาร', '', 'ศูนย์เทคโนโลยีสารสนเทศและการสื่อสาร', '', 991, '2017-01-20 00:36:13', '2017-01-20 00:39:29');
INSERT INTO `news` (`id`, `news_title_th`, `news_description_th`, `news_title_en`, `news_description_en`, `news_created_at`, `news_place`, `news_tags`, `news_sponsor`, `news_document_file`, `sequence`, `created_at`, `updated_at`) VALUES
(15, 'งานมหกรรม "มาตรฐานสินค้าเกษตรปลอดภัย นำไทยสู่ความยั่งยืน" ระหว่างวันที่  6 - 9 เมษายน 2560 ณ รอยัลพารากอนฮอลล์ ศูนย์การค้าสยามพารากอน', '<p><em><strong>สำนักงานมาตรฐานสินค้าเกษตรและอาหารแห่งชาติ (มกอช.) ได้เป้นเจ้าภาพ จัดงานมหกรรม &quot;มาตรฐานสินค้าเกษตรปลอดภัย นำไทยสู่ความยั่งยืน&quot;&nbsp;ระหว่างวันที่ &nbsp;6 - 9 เมษายน 2560 ณ รอยัลพารากอนฮอลล์ ศูนย์การค้าสยามพารากอน&nbsp;</strong></em></p>\r\n\r\n<p><strong>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; กระทรวงเกษตรและสหกรณ์ จึงได้กาหนดนโยบายให้ปี 2560 เป็นปีแห่งการยกระดับมาตรฐานการเกษตรสู่ความยั่งยืน มุ่งขับเคลื่อนงานเพื่อยกระดับมาตรฐานสินค้าเกษตรและอาหารของไทยทั้งระบบตั้งแต่ต้นน้าถึงปลายน้า หรือ ตั้งแต่ฟาร์มถึงผู้บริโภค (from farm to table) เพื่อมุ่งหวังให้สินค้าเกษตรของไทยมีความปลอดภัยต่อผู้บริโภคทั้งในและต่างประเทศ เป็นการยกระดับสินค้าเกษตรและอาหารของไทยให้เกิดความเชื่อมั่นและยอมรับในตลาดโลก</strong></p>\r\n\r\n<p><strong>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; สานักงานมาตรฐานสินค้าเกษตรและอาหารแห่งชาติ (มกอช.) ในฐานะเป็นหน่วยงานหลักในการกาหนดมาตรฐานสินค้าเกษตร กากับดูแลและให้การรับรองระบบงานด้านระบบการผลิตและระบบคุณภาพสินค้าเกษตรตลอดห่วงโซ่อาหาร ตลอดจนมีหน้าที่ส่งเสริมให้มีการนามาตรฐานสินค้าเกษตรและอาหารไปใช้ มกอช.จึงได้จัดทาโครงการขับเคลื่อนนโยบายยกระดับมาตรฐานการเกษตรสู่ความยั่งยืน ของกระทรวงเกษตรและสหกรณ์ ขึ้น เพื่อให้ ประชาชนทั่วไป รับทราบนโยบายของกระทรวงเกษตรและสหกรณ์ ปี 2560 เป็นปีแห่งการยกระดับมาตรฐานการเกษตรสู่ความยั่งยืน ตลอดจนมีความรู้ความเข้าใจที่ถูกต้องและตระหนักถึงความสาคัญของการผลิตสินค้าเกษตรที่เน้นคุณภาพ ได้มาตรฐาน</strong></p>\r\n', 'PARAGON', '<p>PARAGON</p>\r\n', '2017-04-20', 'รอยัลพารากอนฮอลล์ ศูนย์การค้าสยามพารากอน ', '', 'มกอช.', '', 999, '2017-04-20 00:10:34', '2017-12-28 08:41:38'),
(16, 'โครงการจัดอบรมการใช้งานระบบตามสอบสินค้าเกษตรบนระบบคลาวด์ สำหรับผู้ประกอบการขนาดกลางและขนาดเล็ก (QR Trace on Cloud) และเว็บไซต์ตลาดออนไลน์ www.DGTFARM.COM ระหว่างวันที่ 19-20 ธันวาคม 2560 ณ โรงแรมศรีลำดวน จังหวัดศรีสะเกษ', '<p>ตามที่ สำนักงานมาตรฐานสินค้าเกษรและอาหารแห่งชาติ (มกอช.) โดยศูนย์เทคโนโลยีสารสนเทศและการสื่อสาร (ศทส.) ได้พัฒนาระบบตามสอบสินค้าเกษตรบนระบบคลาวด์ สำหรับผู้ประกอบการขนาดกลางและขนาดเล็ก (QR Trace on Cloud) ซึ่งพัฒนาต่อยอดและรองรับการใช้งานกลุ่มสินค้าเพิ่มเติม คือ กลุ่มสินค้า ข้าว ไข่ ประมง ปศุสัตว์ โดยมีการพัฒนาที่เหมาะสมกับเทคโนโลยีและอุปกรณ์ ทำให้การใช้งานและจัดเก็บข้อมูลมีประสิทธิภาพมากขึ้นและสามารถต่อยอดการจำหน่าย ให้แก่ ผู้ประกอบการ ที่เข้าอบรมระบบตามสอบสิน้คาเกษตร&nbsp;โดยใช้ www.DGTFARM.COM&nbsp; เป็นช่องทางในการสื่อสารระหว่างผู้ซื้อและผู้ขาย ให้เข้าใจกระบวนการทำงานของตลาดออนไลน์&nbsp;</p>\r\n', 'โครงการจัดอบรมการใช้งานระบบตามสอบสินค้าเกษตรบนระบบคลาวด์ สำหรับผู้ประกอบการขนาดกลางและขนาดเล็ก (QR Trace on Cloud) และเว็บไซต์ตลาดออนไลน์ www.DGTFARM.COM ระหว่างวันที่ 19-20 ธันวาคม 2560 ณ โรงแรมศรีลำดวน จังหวัดศรีสะเกษ', '<p>โครงการจัดอบรมการใช้งานระบบตามสอบสินค้าเกษตรบนระบบคลาวด์ สำหรับผู้ประกอบการขนาดกลางและขนาดเล็ก (QR Trace on Cloud) และเว็บไซต์ตลาดออนไลน์ www.DGTFARM.COM ระหว่างวันที่ 19-20 ธันวาคม 2560 ณ โรงแรมศรีลำดวน จังหวัดศรีสะเกษ</p>\r\n', '2017-12-22', 'โรงแรมศรีลำดวน', '', 'ศูนย์เทคโนโลยีสารสนเทศและการสื่อสาร (มกอช.)', '', 2, '2017-12-28 08:32:22', '2018-04-02 04:53:03'),
(17, 'โครงการจัดอบรมการใช้งานระบบตามสอบสินค้าเกษตรบนระบบคลาวด์ สำหรับผู้ประกอบการขนาดกลางและขนาดเล็ก (QR Trace on Cloud) และเว็บไซต์ตลาดออนไลน์ www.DGTFARM.COM ระหว่างวันที่ 26-27 ธันวาคม 2560 ณ ห้องอบรมมหาลัยนเรศวร  จังหวัดพิษณุโลก', '<p>โครงการจัดอบรมการใช้งานระบบตามสอบสินค้าเกษตรบนระบบคลาวด์ สำหรับผู้ประกอบการขนาดกลางและขนาดเล็ก (QR Trace on Cloud) และเว็บไซต์ตลาดออนไลน์ www.DGTFARM.COM ระหว่างวันที่ 26-27 ธันวาคม 2560 ณ ห้องอบรมมหาลัยนเรศวร &nbsp;จังหวัดพิษณุโลก</p>\r\n', 'โครงการจัดอบรมการใช้งานระบบตามสอบสินค้าเกษตรบนระบบคลาวด์ สำหรับผู้ประกอบการขนาดกลางและขนาดเล็ก (QR Trace on Cloud) และเว็บไซต์ตลาดออนไลน์ www.DGTFARM.COM ระหว่างวันที่ 26-27 ธันวาคม 2560 ณ ห้องอบรมมหาลัยนเรศวร  จังหวัดพิษณุโลก', '<p>QR TRACE ON CLOUD</p>\r\n', '2017-12-28', ' ห้องอบรมมหาลัยนเรศวร  จังหวัดพิษณุโลก', '', 'ศูนย์เทคโนโลยีสารสนเทศและการสื่อสาร (มกอช.)', '', 2, '2017-12-28 08:57:14', '2017-12-28 08:57:14'),
(18, 'การอบรมการใช้งานระบบการตามสอบสินค้าเกษตรสำหรับผู้ประกอบการขนาดกลางและขนาดเล็ก (QR Trace On Cloud) และเว็บไซต์ตลาดออนไลน์ DGT Farm ระหว่างวันที่ 3-4 เมษายน 2561  ณ โรงแรมนานาชาติ จังหวัดชลบุรี', '<p>สำนักงานมาตรฐานสินค้าเกษตรและอาหารแห่งชาติ จัดอบรมระบบตามสอบสินค้าเกษตรสำหรับผู้ประกอบการขนาดกลางและขนาดเล็ก</p>\r\n\r\n<p>ระหว่างวันที่ 3-4&nbsp;เมษายน&nbsp;2561&nbsp; ณ โรงแรมนานาชาติ จังหวัดชลบุรี</p>\r\n', 'QR Trace On Cloud', '<p>QR Trace On Cloud</p>\r\n', '2018-04-03', 'โรงแรมนานาชาติ บางแสน จังหวัดชลบุรี', '', 'สำนักงานมาตรฐานสินค้าเกษตรและอาหารแห่งชาติ', '', 2, '2018-04-02 04:10:35', '2018-05-08 03:21:54'),
