(4, 'sale', 'บ้านดาวอินคา', '<p><strong>น้ำมันดาวอินคา100%</strong> &nbsp; ราคา &nbsp;950 &nbsp;บาท &nbsp;ขนาด &nbsp;250 &nbsp;ml<br />\r\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;<strong>พิเศษ</strong> &nbsp;2 &nbsp;ขวด &nbsp;ราคา &nbsp;1600 &nbsp;บาท<br />\r\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; 4 &nbsp;ขวด &nbsp;ราคา &nbsp;3000 &nbsp;บาท &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;(ฟรีลงทะเบียน)</p>\r\n\r\n<h3><strong>สรรพคุณของ น้ำมันถั่วดาวอินคา</strong></h3>\r\n\r\n<p>ผลการวิจัยล่าสัดได้แสดงให้เห็นว่า น้ำมันถั่วดาวอินคา เป็นน้ำมันเพื่อช่วยรักษาความหลากหลายของสภาวะสุขภาพของมนุษย์ น้ำมันถั่วดาวอินคา ไม่มีคอเลสเตอรอลสะสม</p>\r\n\r\n<p>จะช่วยลดระดับคอเลสตอรอล LDL และเพิ่ม HDL&nbsp; และลดการแข็งตัวของเลือด โดยการรักษาไขมันอิ่มตัวในกระแสเลือด เหมาะสำหรับผู้ป่วย โรคหัวใจ ความดันโลหิตสูง และ โรคเบาหวาน</p>\r\n\r\n<p>ลดน้ำหนักควบคุมระดับน้ำตาลในเลือด ลดอาการซึมเศร้า &nbsp;สุขภาพแจ่มใส รักษาความลื่นไหลและความแข็งแกร่งของเยื้อหุ้มเซลล์ ช่วยลดการอักเสบ ของหลอดเลือดโรคไขข้อ เหมาะสำหรับผู้ป่วย โรคผิดหนัง หอบหืด แผล ไมเกรน ต้อหิน มีสารต้านอนุมูลอิสระสูง ควบคุมการทำงานของดวงตาข้อต่อความดัน&nbsp;</p>\r\n', '950.00', 1, '100.00', 'upload/products/0.26690900 1527090313.jpg', 'upload/products/0.83947400 1502163347.jpg', '', 'open', '0.00', '0.00', '0.00', '0.00', 'ชิ้น', '', ' ทุกจังหวัด', 9, 1555, 5, NULL, NULL, 'A', NULL, NULL, 19, 0, '1970-01-01 00:00:00', '1970-01-01 00:00:00', 'year', 'all', '2017-08-08 03:35:07', '2018-05-23 15:45:14', '', '1', 1, 100, -1, NULL),
