(151, 'sale', 'ข้าวรัชดา', '<p>นางศิริอร &nbsp;ช่างทองคลองสี่<br />\r\nSirion &nbsp;Changthogkhongsee<br />\r\nเบอร์โทรศัพท 0871188341<br />\r\nFacebook &nbsp;sirion bunsiri<br />\r\nPage &nbsp; พันธุ์ข้าวไรซ์เบอรี่ ข้าวกล้องไรซ์เบอรี่<br />\r\nLine &nbsp; &nbsp;Jewien , Aongor<br />\r\nชื่อผลิตภัณฑ์ &nbsp;ข้าวรัชดา ข้าวกล้องไรซ์เบอรี่</p>\r\n\r\n<p>เรื่องราว ความเป็นมา จุดเด่นของผลิตภัณฑ์&nbsp;</p>\r\n\r\n<p>กว่าจะมาเป็นข้าวไรซ์เบอรี่ ข้าวรัชดา เราปลูกด้วยความรัก ใส่ใจดูและกันเช้าค่ำ ทุกเช้าอากงอายุ 75 แล้ว ผู้ปลูกข้าวไรซ์เบอรี่ จะนั่งรถไปดูนาทุกเช้าเย็น&nbsp;<br />\r\nมองไปด้วยความสุข ว่าวันนี้ข้าวของเราเป็นอย่างไรบ้าง สูงขึ้นกี่ CM. &nbsp;แล้ว เป็นความสุขของชาวนาอย่างนึงที่เราได้ไปดูท้องทุ่งสีเขียว นี่ไม่ใช่แค่ต้นข้าวนะ แต่เป็นต้นแห่งความรัก ที่เราทะนุถนอมในการดูแลรักษา ปุ๋ยที่เราใส่เราก็เลือกที่ไม่เป็นพิษต่อดิน น้ำที่เราสูบมาใส่ เราก็พักไว้ ให้น้้ำสะอาดที่สุด ยิ่งเป็นนาปีแล้วด้วย เราจะได้น้ำจากน้ำฝน เรียกว่าเป็นนาเทวดาเลี้ยงกันเลยเชียว &nbsp;ยาฆ่าแมลงเราก็ไม่ใช้เรากลัวต้นข้าวเราปวดแสบปวดร้อน เราใช้ผลิตภัณฑ์ที่เราทำเอง เป็นสมุนไพรไล่แมลง เพื่อให้ปลอดภัยทั้งคนกินและคนขาย เพราะบ้านเราก็กินข้าวที่เราปลูกเอง เรากินยังไง เราก็ปลูกขายแบบนั้น เราก็กลัวตายเหมือนกัน ดังนั้น เราจึงต้องปลูกด้วยวิถีแห่งธรรมชาติ &nbsp;ข้าวที่สีมา บางทีก็เมล็ดขาวบ้าง ที่บ้านเราก็ใช้แรงงานคนนี่แหละ ช่วยกันคัดที่ละเมล็ด นอกเหนือจากข้าวที่เรากินอิ่มท้องแล้ว ข้าวเรายังเป็นข้าวแห่งความเพียรด้วยนะ เพราะกว่าข้าวตั้้งแต่เพราะเมล็ด จนเป็นกล้าข้าว เป็นต้นข้าว ตั้งท้อง ออกรวง สีข้าว คัดเมล็ด &nbsp;เราล้วนปลูกด้วยความเพียรพยาม ใส่ความรักลงไป&nbsp;<br />\r\nข้าวเรากินแล้วนอกจากอิ่มท้อง ก็อิ่มใจ มีความสุขที่ได้กินข้าว รัชดาทุกคำ...<br />\r\nเราไม่ได้ขายเพียงข้าวเพื่อได้เงิน...เราไม่ได้ทำนาเพียงเพื่อยังชีพ แต่เราขายสุขภาพที่ดีให้กับลูกค้า..เราทำอาชีพที่มีความสุข...เพื่อเลี้ยงจิตวิณญาณ...</p>\r\n\r\n<p>ร่างกายไม่ได้ต้องการบริโภคแต่อาหาร...แต่ยังต้องการความรู้สึกด้วย ..ข้าวเราค่อย ค่อยกิน เคี้ยวช้าช้า จะได้รสแห่งความรักและความเพียรของชาวนา...<br />\r\nข้าวรัชดา ข้าวแห่งความรัก&nbsp;</p>\r\n\r\n<p>ปล.ข้าวรัชดา เป็นชื่อจริงของลูกสาวของพ่อข้าวสวยด้วย</p>\r\n\r\n<p>เราเป็นชาวนาไม่ได้ปลูกข้าวเพื่อร่ำรวย แต่เราปลูกด้วยความรัก</p>\r\n\r\n<p>มาตรฐานผลิตภัณฑ สินค้ามาตรฐาน Q มาตรฐานการผลิต &nbsp;Primary GMP</p>\r\n', '90.00', 1, '100.00', 'upload/products/0.39107300 1502783287.jpg', 'upload/products/0.67677400 1502783289.jpg', '', 'open', '0.00', '0.00', '0.00', '0.00', 'กิโลกรัม', '', ' ทุกจังหวัด', 12, 1563, 82, NULL, NULL, '-', NULL, NULL, 4, 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00', 'year', 'all', '2017-08-15 07:48:10', '2017-08-15 07:48:10', '', '1', 1, 100, -1, NULL),
