(196, 'sale', 'เครือข่ายข้าวสัจธรรมอำนาจเจริญ', '<p><strong>ข้าวกล้องหอมมะลิอินทรีย์แท้ 100% &nbsp;</strong>เป็นข้าวอินทรีย์ไร้สารพิษ ผลิตด้วยระบบการผ่านรับรองมาตรฐานเกษตรอินทรีย์ของสมาพันธ์เกษตรอินทรีย์นานาชาติ</p>\r\n', '50.00', 1, '1000.00', 'upload/products/0.77138900 1513154733.jpg', '', '', 'open', '0.00', '0.00', '0.00', '0.00', 'กิโลกรัม', '', ' ทุกจังหวัด', 12, 1684, 140, NULL, NULL, '-', NULL, NULL, 26, 0, '1970-01-01 00:00:00', '1970-01-01 00:00:00', 'year', 'all', '2017-08-30 02:44:45', '2017-12-13 08:45:34', '', '1', 1, 1000, -1, NULL),
(197, 'sale', 'เครือข่ายข้าวสัจธรรมอำนาจเจริญ', '<p><strong>ข้าวขัดขาวหอมมะลิอินทรีย์แท้ 100% &nbsp;</strong>เป็นข้าวอินทรีย์ไร้สารพิษ ผลิตด้วยระบบการผ่านรับรองมาตรฐานเกษตรอินทรีย์ของสมาพันธ์เกษตรอินทรีย์นานาชาติ</p>\r\n', '50.00', 1, '1000.00', 'upload/products/0.76595900 1513154714.jpg', '', '', 'open', '0.00', '0.00', '0.00', '0.00', 'กิโลกรัม', '', ' ทุกจังหวัด', 12, 1685, 140, NULL, NULL, '-', NULL, NULL, 26, 0, '1970-01-01 00:00:00', '1970-01-01 00:00:00', 'year', 'all', '2017-08-30 02:46:40', '2017-12-13 08:45:15', '', '1', 1, 1000, -1, NULL),
(198, 'sale', 'คอรโค', '<ol>\r\n	<li>มีมาตรฐานเกษตรอินทรีย์รับรอง</li>\r\n	<li>เป็นข้าวนาปีปลูกได้ปีละครั้งจึงทำให้ข้าวมี่คุณค่าโภชนาการสูง และหอม นุ่ม อร่อยเ มื่อหุงสุข</li>\r\n	<li>สต้อกเป็นข้าวเปลือกได้รับการสั่งซื้อจึงทำการสีและบรรจุถุงทันที่ภายใน 24 ชั่งโมง จึงทำให้ข้าว หอม นุ่ม อร่อย และมีคุณค่าโภชนาการสูง&nbsp;</li>\r\n</ol>\r\n', '100.00', 1, '1000.00', 'upload/products/0.19075000 1513236371.jpg', '', '', 'open', '0.00', '0.00', '0.00', '0.00', 'กิโลกรัม', '', ' ทุกจังหวัด', 12, 1413, 23, NULL, NULL, '-', NULL, 1, 21, 0, '1970-01-01 00:00:00', '1970-01-01 00:00:00', 'year', 'all', '2017-08-30 02:50:59', '2017-12-14 07:26:12', '', '1', 1, 100, 1, 'กิโลกรัม'),
(199, 'sale', 'คอร์โค', '<p>ข้าวทุกสายพันธุ์ที่ปลูกในพื้นที่ตำบลคอโค โดยภูมิประเทศปลูกข้าวได้ผลผลิตปีละครั้ง จำกัดด้วยธรรมชาติคือน้ำ นาน้ำฝนจะได้ผลผลิตก็ต่อเมื่อมีฝน นั่นคือเสน่ห์ที่ทำให้ผลผลิตข้าวหอมดอกมะลิจากสุรินทร์มีรสชาด หอม นุ่ม อร่อย ยิ่งเมื่อปลูกด้วยเกษตรอินทรีย์ตามวิถีของชุมชน &nbsp;ไม่เพียงแต่หอม นุ่มอร่อย ยังมีสรรพคุณและให้คุณค่าตามโภขนาการของข้าวแต่ละสายพันธุ์ที่ปลูก มีคณะกรรมการตรวจสอบมาตรฐานเกษตรอินทรีย์ภายในกลุ่ม (ICS) ที่มีความรู้ในเรื่องเกษตรอินทรีย์ คอยตรวจแปลงและให้ความรู้ปรึกษากับสมาขิก เพื่อให้ได้มาซึ่ง อาหารที่ดีมีคุณภาพส่งต่อผู้บริโภคอย่างมั่นใจ</p>\r\n', '60.00', 1, '100.00', 'upload/products/0.18751100 1513236199.jpg', '', '', 'open', '0.00', '0.00', '0.00', '0.00', 'กิโลกรัม', '', ' ทุกจังหวัด', 12, 1413, 23, NULL, NULL, '-', NULL, 500, 21, 0, '1970-01-01 00:00:00', '1970-01-01 00:00:00', 'year', 'all', '2017-08-30 02:52:56', '2017-12-14 07:23:20', '', '5', 1, 100, 1, 'กรัม'),
(200, 'sale', 'นาคแดง', '<p><strong>ข้าวฮางเพาะงอกเม็ด 6 สายพันธ์ุ (ราคาสินค้าไม่รวมค่าขนส่ง)</strong></p>\r\n', '130.00', 1, '1000.00', 'upload/products/0.88501600 1504065790.jpg', '', '', 'open', '0.00', '0.00', '0.00', '0.00', 'กิโลกรัม', '', ' ทุกจังหวัด', 9, 1686, 26, NULL, NULL, '-', NULL, 1, 25, 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00', 'year', 'all', '2017-08-30 04:03:12', '2017-08-30 04:03:12', 'OTOP 5 ดาว', '1', 1, 1000, 1, 'กิโลกรัม'),
(201, 'sale', 'นาคแดง', '<p><strong>ข้าวกล้องงอกผง ชงดื่ม ขนาดบรรจุ&nbsp;16 g.x10 ซอง</strong></p>\r\n\r\n<p><strong>(ราคาสินค้าไม่รวมค่าขนส่ง)</strong></p>\r\n', '160.00', 1, '500.00', 'upload/products/0.95401000 1504066016.jpg', '', '', 'open', '0.00', '0.00', '0.00', '0.00', 'กล่อง', '', ' ทุกจังหวัด', 9, 1705, 26, NULL, NULL, '-', NULL, NULL, 25, 0, '1970-01-01 00:00:00', '1970-01-01 00:00:00', 'year', 'all', '2017-08-30 04:06:58', '2017-08-31 03:57:50', 'OTOP 5 ดาว', '1', 1, 500, -1, NULL),
