(204, 'sale', 'ตราปั้นข้าว', '<p><strong>ข้าวกล้องผสมธัญพืชอบกรอบ ตราปั้นข้าว&nbsp;มี 3 รส</strong></p>\r\n\r\n<p>ร<strong>าคากล่องละ 45&nbsp;บาท</strong></p>\r\n\r\n<p><strong>สีเหลือง รสทุเรียน</strong></p>\r\n\r\n<p><strong>สีน้ำเงิน รสรวมทะเล</strong></p>\r\n\r\n<p><strong>สีน้ำตาล ส้มรสฮีนนี่คาราเมล</strong></p>\r\n\r\n<p>ราคาส่งสามารถติดต่อราคาได้เพิ่มเติมค่ะ</p>\r\n\r\n<p><strong>(ราคาสินค้าไม่รวมค่าขนส่ง)</strong></p>\r\n', '60.00', 1, '1000.00', 'upload/products/0.56535500 1504067286.jpg', '', '', 'open', '0.00', '0.00', '0.00', '0.00', 'กล่อง', '', ' ทุกจังหวัด', 9, 1688, 25, NULL, NULL, '-', NULL, NULL, 73, 0, '1970-01-01 00:00:00', '1970-01-01 00:00:00', 'year', 'all', '2017-08-30 04:28:07', '2017-09-01 03:10:40', '', '1', 1, 1000, -1, NULL),
(205, 'sale', 'มโนราห์ ไรส์', '<p><strong>ข้าวสังข์หยด ตรามโนราห์ ไรส์&nbsp;แทนความรักจากพัทลุง</strong></p>\r\n\r\n<p>สนใจสั่งซื้อราคาส่งติดต่อราคาเพิ่มเติม</p>\r\n\r\n<p><strong>(ราคาสินค้าไม่รวมค่าขนส่ง)</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n', '85.00', 1, '1000.00', 'upload/products/0.42546300 1504067559.jpg', '', '', 'open', '0.00', '0.00', '0.00', '0.00', 'กิโลกรัม', '', ' ทุกจังหวัด', 12, 1689, 25, NULL, NULL, '-', NULL, 1, 73, 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00', 'year', 'all', '2017-08-30 04:32:40', '2017-08-30 04:32:40', '', '1', 1, 1000, 1, 'กิโลกรัม'),
