(236, 'sale', 'บ้านสวนกาแฟเขาโต๊ะแซะ', '<p><strong>กาแฟเขาโต๊ะแซะ TohSae Coffee</strong></p>\r\n\r\n<p>กาแฟเขาโต๊ะแซะ กาแฟ &quot;โรบัสต้า&quot; ต้นพันธ์ุจากศูนย์วิจัยชุมพร นำมาปลูกบนเขาโต๊ะแซะ การผลิตกาแฟเขาโต๊ะแซะนั้น หลังจากเก็บเมล็ดกาแฟ บ้านสวนการแฟฯใช้กรรมวิธีแบบเปียก และบ่มเมล็ดกาแฟในกะลา 1 ปี&nbsp;จากนั้นสีกะลาและบ่มเมล็ดกาแฟอีก 3-6 เดือนก่อนนำมาคั่วด้วยเตาถ่าน ทำให้ได้รสชาติกาแฟหอมกรุ่น&nbsp;แบบธรรมชาติ เป็นกาแฟที่มีรสกลมกล่อม&nbsp;ชุ่มคอ&nbsp;ถ้าทิ้งไว้ให้เย็นเมื่อดื่มจะมีรสขม และหวานติดลิ้น</p>\r\n\r\n<p>(ราคาส่งติดต่อเพิ่มเติมค่ะ สินค้าราคายังไม่รวมค่าขนส่ง)</p>\r\n', '150.00', 1, '1000.00', 'upload/products/0.19278400 1513581417.jpg', '', '', 'open', '0.00', '0.00', '0.00', '0.00', 'ซอง', '', ' ทุกจังหวัด', 9, 1720, 151, NULL, NULL, '-', NULL, NULL, 66, 0, '1970-01-01 00:00:00', '1970-01-01 00:00:00', 'year', 'all', '2017-09-13 09:30:58', '2018-03-09 03:26:50', '', '1', 1, 1000, -1, NULL),
(238, 'sale', 'บ้านสวนกาแฟเขาโต๊ะแซะ', '<p><strong>ชาดอกกาแฟ&nbsp;</strong></p>\r\n\r\n<p>ผลการวิจัยของสถาบันวิจัยแม่ฟ้าหลวงจังหวัดเชียงรายได้สรุปผลสรรพคุณ ดอกกาแฟ &quot;โรบัสต้า&quot; มีสารต่อต้านอนุมุลอิสระสูงเกือบ 5000 mg. ซึ่งเหมาะสำหรับสุภาพสตรีที่มีโอกาสเป็นโรคมะเร็งชนิดต่างๆสารตัวนี้จะช่วยต้านการเกิดมะเร็ง(ไม่ใช่การป้องกันแค่ต้านและไม่ช่วยในการรักษาหากเป็นแล้ว)</p>\r\n\r\n<p>(ราคาส่งติดต่อเพิ่มเติมค่ะ สินค้าราคายังไม่รวมค่าขนส่ง)</p>\r\n', '100.00', 1, '1000.00', 'upload/products/0.78358500 1513581333.jpg', 'upload/products/0.86273300 1505295508.jpg', '', 'open', '0.00', '0.00', '0.00', '0.00', 'ซอง', '', ' ทุกจังหวัด', 9, 1722, 151, NULL, NULL, '-', NULL, NULL, 66, 0, '1970-01-01 00:00:00', '1970-01-01 00:00:00', 'year', 'all', '2017-09-13 09:38:30', '2017-12-18 07:15:34', '', '1', 1, 1000, -1, NULL),
