(252, 'sale', 'สวนสารพัดดี', '<p><strong>ถั่วดาวอินคา</strong></p>\r\n\r\n<p>ผลการวิจัยล่าสุดได้แสดงให้เห็นถั่วดาวอินคา เป็นน้ำมันเพื่อช่วยรักษาความหลากหลายของสภาวะสุขภาพของมนุษย์ น้ำมันถั่วดาวอินคามี โอเมก้า 3, 6 และ 9 ที่อยู่ในน้ำมันถั่วดาวอินคา จะช่วยในการลดระดับคอเลสเตอรอล HDL, และ ป้องกันการแข็งตัวของเลือด โดยการรักษาระดับไขมันในกระแสเลือด ซึ่งจะช่วยลดความเสี่ยงของโรคหัวใจ ความดันเลือดสูง ช่วยลดระดับไตรกลีเซอไรด์และความดันโลหิตสูง ป้องกัน การเป็นโรคเบาหวาน / ลดน้ำหนักควบคุมระดับน้ำตาลในเลือด ลดอาการซึมเศร้า / สุขภาพจิตแจ่มใส รักษาความแข็งแกร่งของเยื่อหุ้มเซลล์ ช่วยลดการอักเสบของหลอดเลือดโรคไขข้อ รักษาโรคผิวหนัง หอบหืด แผล ไมเกรน ต้อหิน มีสารต้านอนุมูลอิสระ ควบคุมความดันและของเส้นเลือดและการตอบสนองของระบบภูมิคุ้มกัน หน้าที่เป็นสื่อกลางขนส่งออกซิเจนเครือข่ายจากเซลล์ของเลือดไปยังเนื้อเยื่อ รักษาไตทำงานที่เหมาะสมและการไหลของและอื่น ๆ</p>\r\n\r\n<p>สนใจติดต่อ 080-6843434 ครูรัตนา, 080-3483019 ปวันรัตน์</p>\r\n', '60.00', 1, '100.00', 'upload/products/0.38275400 1513071417.jpg', 'upload/products/0.55721100 1513070245.jpg', 'upload/products/0.55855400 1505443503.jpg', 'open', '0.00', '0.00', '0.00', '0.00', 'ซอง', '', ' ทุกจังหวัด', 9, 1727, 157, NULL, NULL, '-', NULL, NULL, 9, 0, '1970-01-01 00:00:00', '1970-01-01 00:00:00', 'year', 'all', '2017-09-15 02:45:04', '2017-12-12 09:36:58', 'อ.ย.', '1', 1, 100, -1, NULL),
