(283, 'sale', 'แป้งสาคูต้นพัทลุงบ้านฉัน', '<p>&quot;แป้งสาคูต้นพัทลุงบ้านฉัน&quot; ผลิตจากต้นสาคูแท้ๆ</p>\r\n\r\n<p>&quot;สาคูในท้องตลาดถูกแทนที่ด้วยแป้งมันสำปะหลังแทนเพราะต้นสาคูเริ่มหาได้ยาก ปลูกได้เฉพาะภาคใต้ และใช้เวลาปลูกนานถึง 9 ปี กว่าจะได้เป็นแป้งออกมา แป้งสาคูที่มำมาจากมันสำปะหลังจึงขาดกลิ่นหอมแบบธรรมชาติ ขาดความนุ่มละมุนซึ่งเป็นเอกลักษณ์ของแป้งสาคูที่ผลิตจากต้นสาคูแท้ๆ&quot;</p>\r\n\r\n<p>- กากใยสูงย่อยง่าย</p>\r\n\r\n<p>- ปลอดกลูเตน</p>\r\n\r\n<p>- ปลอด GMO</p>\r\n\r\n<p>- ไร้สารเคมี&nbsp;</p>\r\n\r\n<p>- ไร้สารฟอกขาว</p>\r\n\r\n<p>&quot;แป้งสาคูต้นพัทลุงบ้านฉัน&quot; ทำอะไรได้บ้าง<br />\r\n#ขนมไทย: สาคูเปียก สาคูไส้ต่างๆ หยกมณี<br />\r\nขนมจาก ขนมกวน ลอดช่อง ตะโก้สาคู</p>\r\n\r\n<p>#อื่นๆ : เค้ก คุกกี้ แพนเค้ก ขนมปัง จาปาตี<br />\r\nบิสกิต คัสตาร์ด พุดดิ้ง เส้นก๋วยเตี๋ยว<br />\r\nเพิ่มความหนืดเหนียวแก่อาหาร</p>\r\n\r\n<p>**ใช้เป็นส่วนผสมในอาหารของเด็กอ่อนหรือผู้ป่วย เนื่องจาก ประกอบด้วยแป้งที่ร่างกายย่อย และนำไปใช้ประโยชน์ได้ง่าย</p>\r\n\r\n<p>#การทำสาคูเปียกจาก&quot;แป้งสาคูต้นพัทลุงบ้านฉัน&quot;<br />\r\n1. ต้มน้ำให้เดือดก่อนนะคะ (น้ำ:แป้งสาคู 1:1)ชอบหวานให้ใส่น้ำตาลลงไป(แนะนำน้ำตาลมะพร้าว น้ำตาลโตนด จะหอมหวาน)<br />\r\n2. ค่อยๆเทแป้งสาคูละไปทีละนิดแล้วค่อยๆกวนไปในทิศทางเดียวกันหากแป้งสาคูข้นเหนียวเกินไปให้ใส่น้ำร้อนลงไปเพิ่ม<br />\r\n3. ใส่ข้าวโพดต้ม มะพร้าวอ่อนขูด ขนุน หรืออื่นๆเพิ่มได้ตามใจชอบค่ะ<br />\r\n4. ยกลงจากเตา<br />\r\n5. เตรียมกะทิสดใส่เกลือเล็กน้อย ถ้าชอบสีสันใช้สีธรรมชาติ ( ใช้อัญชัน ม่วงนวลสวยงาม)<br />\r\n6. ตักกะทิราดบนสาคูที่กวนเสร็จเรียบร้อยแล้ว<br />\r\n7. กินเลยจ้า</p>\r\n\r\n<p>#กว่าจะเป็นแป้งสาคู<br />\r\n&quot;ต้นสาคู&quot; กว่าจะเป็น &quot;แป้งสาคูต้น&quot; ต้องรอเวลาถึงเก้าปี เก้าปีเป็นเลขที่บอกอายุขัยของต้นสาคู ก่อนที่ต้นสาคูจะตายเป็นอาหารของด้วงนั้น สาคูแตกดอกคล้ายเขากวางนี่คือลางบอกเหตุว่าต้นสาคูกำลังจะจากโลกนี้ไปแล้ว และเป็นระยะที่ต้นสาคูสมบูรณ์เต็มที่ และที่สำคัญระยะนี้สาคูจะมีแป้งตรงแกนกลางลำต้น แต่กว่าจะเป็นแป้งนั้น<br />\r\n-&gt; ต้องใช้เลื่อยยนต์ ตัดโค่นลงมา และตัดแบ่งเป็นท่อน ๆ ยาวประมาณ 50 เซนติเมตร แช่น้ำไว้ เพื่อรักษาคุณภาพแป้งให้อยู่ในสภาพที่ดีได้นานขึ้น และจะไม่เกิดการเปลี่ยนแปลงจากปฏิกิริยาเคมี<br />\r\n-&gt;หลังจากนั้นทำการถากเปลือกนอกออก เลือกเอาแต่ไส้ในตอนกลาง ๆ ของลำต้น แล้วใช้ขวานผ่าให้เป็นชิ้นเล็ก ๆ และนำไปบดโดยเครื่องโม่บด<br />\r\n-&gt;จากนั้นนำไปผสมน้ำแล้วทำการแยกแป้งออก โดยการบิด บีบ และนำมากรองเอาแป้ง การใช้อุปกรณ์ในการกรองที่แตกต่างกัน จะให้แป้งที่มีคุณภาพต่าง ๆ กัน<br />\r\n-&gt;จากนั้นนำแป้งที่แยกได้ มาตากแดดให้แห้ง ก็จะได้&quot;แป้งสาคูพัทลุงบ้านฉัน&quot;</p>\r\n\r\n<p>&quot;Our Loss is Our Gain ขาดทุนคือกำไร&quot; ตามปรัชญาเศรษฐกิจพอเพียง</p>\r\n\r\n<p>#แป้งสาคูต้นพัทลุงบ้านฉัน<br />\r\n0.5 กิโลกรัม &ndash;&gt; 150 บาท<br />\r\n80 กรัม&mdash;&mdash;&gt; 35 บาท (3 ถุง 100)</p>\r\n', '35.00', 1, '1000.00', 'upload/products/0.86061000 1505894002.JPG', 'upload/products/0.18250500 1505894005.jpg', 'upload/products/0.28581000 1505894007.jpg', 'open', '0.00', '0.00', '0.00', '0.00', 'ห่อ', '', ' ทุกจังหวัด', 9, 1747, 168, NULL, NULL, '-', NULL, 80, 73, 0, '1970-01-01 00:00:00', '1970-01-01 00:00:00', 'year', 'retail', '2017-09-20 07:53:28', '2018-02-06 04:35:01', 'กำลังขอ อย.', '3', 1, 797, 1, 'กรัม'),
(284, 'sale', 'ลุงนัด', '<p>เส้นมักกะโรนีจากแป้งข้าวสังข์หยด (Organic Rice Macaroni)</p>\r\n\r\n<p>เส้นมักกะโรนีที่ผลิตจากข้าวสังข์หยดซึ่งเป็นข้าวกล้องเกษตรอินทรีย์แท้และเป็นข้าวจีไอ (GI) ที่บ่งบอกถึงคุณภาพการันตีจากในประเทศและต่างประเทศ รัฐบาลรับรองว่าเป็นข้าวดีมีคุณภาพ ในกระบวนการผลิตเส้นมักกะโรนียังรักษาความเป็นธรรมชาติ โดยไม่มีการใส่สี หรือสารเคมีใด ๆเพื่อปรุงแต่ง ไม่มีสารกันเสีย สีที่เห็นได้จากข้าวทำให้มีสีสวยงามน่ารับประทาน ทั้งยังปลอดภัยจากสารเคมีต่าง ๆ และไม่มีส่วนผสมของแป้งข้าวสาลี ซึ่งไม่ก่อให้เกิดการแพ้สารกลูเตน จึงจัดว่าเป็น Gluten free Macaroni</p>\r\n\r\n<p>ทางเลือกใหม่ของผู้ที่รักสุขภาพ และสำหรับผู้ที่แพ้แป้งสาลี ที่ต้องการได้รับสารอาหารจากข้าวกล้องที่อุดมไปด้วยคุณค่าทางโภชนาการสูงกว่าข้าวสาลีขัดขาว &nbsp;ในข้าวกล้องนั้นอุดมไปด้วยคุณค่าทางโภชนาการด้วยสารอาหารนานาชนิดจากจมูกข้าวและรำข้าว ได้แก่</p>\r\n\r\n<p>Manganese (แมงกานีส) ช่วยบำรุงสมอง ต้านอนุมูลอิสระ ลดโคเลสเตอรอล<br />\r\nSelenium (ซีลีเนียม) ช่วยเพิ่มภูมิคุ้มกันของร่างกาย ยับยั้งเซลล์มะเร็ง<br />\r\nMagnesium (แมกนีเซียม) ช่วยรักษาไมเกรน โรคหัวใจ<br />\r\nVitamin E (วิตามินอี) ต้านอนุมูลอิสระ บำรุงผิวพรรณ<br />\r\nVitamin B (วิตามินบี) ป้องกันโรคเหน็บชา โรคปากนกกระจอก บำรุงระบบประสาทและสมอง<br />\r\nIron หรือ ธาตุเหล็ก ช่วยบำรุงเลือด ป้องกันโรคโลหิตจาง<br />\r\nFiber (ใยอาหาร) ทำหน้าที่ดูดซับสารพิษ ไขมัน ช่วยระบบขับถ่าย ต้านเบาหวาน<br />\r\nGABA (Gamma Amino butyric Acid) มีส่วนช่วยบำรุงระบบประสาทและสมอง ช่วยให้ผ่อนคลาย ป้องกันโรคอัลไซเมอร์<br />\r\nGamma Oryzanol พบมากในรำข้าวและจมูกข้าว มีสารต้านอนุมูลอิสระสูง ช่วยลดโคเลสเตอรอล</p>\r\n\r\n<p>#ไม่มีกลูเตน<br />\r\n#ไม่มีแป้งสาลี<br />\r\n#ไม่มีถั่วลิสง<br />\r\n#ไม่มีนมวัว<br />\r\n#ไม่มีไข่<br />\r\n#ไม่มีถั่วเหลือง<br />\r\n#ไม่มีถั่วเปลืองแข็ง<br />\r\n#ไม่มีวัตถุกันเสีย<br />\r\n#Non-GMO<br />\r\n#No-Cholesterol<br />\r\n#Vegans<br />\r\n#Made in Thailand</p>\r\n', '75.00', 1, '500.00', 'upload/products/0.30759600 1505963564.jpg', 'upload/products/0.48339800 1505963566.jpg', 'upload/products/0.63296800 1505963568.jpg', 'open', '0.00', '0