(285, 'sale', 'Momberry', '<p>มัลเบอร์รี่ เรียกอีกอย่างหนึ่งได้ว่า ลูกหม่อน หม่อนที่เราเคยเรียนกันว่าปลูกหม่อนเลี้ยงไหมนั่นแหละครับ&nbsp;มัลเบอร์รี่เป็นผลไม้ที่อุดมไปด้วยวิตามินและแร่ธาตุ เช่น กรดโฟลิก ซึ่งพบว่าทารกที่เกิดจากมารดาที่ขาดกรดโฟลิก มีความเสี่ยงที่จะพิการทางสมองและประสาท ไขสันหลัง นอกจากนั้นยังพบสารต้านอนุมูลอิสระ เช่น แอนโธไชยานินเควอซิติน ที่มีส่วนลดความเสี่ยงในการเกิดโรคมะเร็ง ตำรับยาโบราณมีการใช้ผลหม่อนต้มบริโภคทั้งเนื้อและน้ำแก้โรคไขข้ออักเสบ ท้องผูก โลหิตจาง และขับเสมหะ ด้วยความที่เจ้ามัลเบอร์รี่มีสารต้านอนุมูลอิสระหลากหลายจึงมีส่วนช่วยในการเพิ่มการทำงาน และลดการอักเสบของหลอดเลือด อันเป็นสาเหตุของโรคหัวใจและหลอดเลือด รวมทั้งโรคทางระบบประสาทและสมอง</p>\r\n', '35.00', 1, '1000.00', 'upload/products/0.47386400 1507573729.jpg', 'upload/products/0.56041000 1507573731.jpg', 'upload/products/0.61575100 1507573733.jpg', 'open', '0.00', '0.00', '0.00', '0.00', 'ขวด', '', ' ทุกจังหวัด', 9, 1750, 175, NULL, NULL, 'A', NULL, 250, 10, 0, '1970-01-01 00:00:00', '1970-01-01 00:00:00', 'year', 'retail', '2017-10-09 18:22:38', '2017-10-09 18:28:54', '', '12', 1, 200, 1, 'มิลลิลิตร'),
