(309, 'sale', 'ไร่สุมิตรา', '<p><strong>กล้วยน้ำว้าออร์แกนิคอบแห้ง Less Sweet (หวานน้อย)</strong></p>\r\n\r\n<p><strong>จำหน่ายโดย&nbsp;<a href="https://www.facebook.com/SumitthaFarm/">ไร่สุมิตธา Sumittha Farm - Organic Rice &amp; Fruits</a></strong></p>\r\n\r\n<p>เรานำกล้วยน้ำว้าที่ยังห่ามเล็กน้อย มาอบด้วยเครื่องอบลมร้อน ทำให้เก็บรักษาคุณค่าทางอาหารและปรโยชน์ของกล้วยน้ำว้าเหมือนทานกล้วยน้ำว้าสด แต่สามารถนำมาทานเมื่อไหร่ก็ได้ที่คุณต้องการ ทานลองท้องยามหิว หรือจะทานเล่นเป็นของว่างของได้ ทานได้ทั้งเด็กและผู้ใหญ่ รสชาติไม่หวานมากเหมาะสำหรับคนที่ไม่ชอบหวาน</p>\r\n\r\n<p>(ราคาสินค้ายังไม่รวมค่าขนส่ง)</p>\r\n', '75.00', 1, '2000.00', 'upload/products/0.76412700 1513151601.jpg', 'upload/products/0.92113700 1508474422.jpg', '', 'open', '0.00', '0.00', '0.00', '0.00', 'ห่อ', '', ' ทุกจังหวัด', 9, 1759, 194, NULL, NULL, '-', NULL, NULL, 17, 0, '1970-01-01 00:00:00', '1970-01-01 00:00:00', 'year', 'all', '2017-10-20 04:40:23', '2017-12-28 02:51:24', '', '1', 1, 1980, -1, NULL),
(312, 'sale', 'ไร่สุมิตรา', '<p><strong>กล้วยน้ำว้าออร์แกนิคอบแห้ง Original</strong></p>\r\n\r\n<p><strong>จำหน่ายโดย&nbsp;<a href="https://www.facebook.com/SumitthaFarm/">ไร่สุมิตธา Sumittha Farm - Organic Rice &amp; Fruits</a></strong></p>\r\n\r\n<p>เรานำกล้วยน้ำว้าสุก มาอบด้วยเครื่องอบลมร้อน ทำให้เก็บรักษาคุณค่าทางอาหารและประโยชน์ของกล้วยน้ำว้าเหมือนทานกล้วยน้ำว้าสด แต่สามารถนำมาทานเมื่อไหร่ก็ได้ที่คุณต้องการ ทานลองท้องยามหิว หรือจะทานเล่นเป็นของว่างของได้ ทานได้ทั้งเด็กและผู้ใหญ่</p>\r\n', '75.00', 1, '2000.00', 'upload/products/0.29856400 1513151667.jpg', 'upload/products/0.53908000 1508474649.jpg', '', 'open', '0.00', '0.00', '0.00', '0.00', 'ห่อ', '', ' ทุกจังหวัด', 9, 1759, 194, NULL, NULL, '-', NULL, NULL, 17, 0, '1970-01-01 00:00:00', '1970-01-01 00:00:00', 'year', 'all', '2017-10-20 04:44:10', '2017-12-28 02:51:24', '', '1', 1, 1980, -1, NULL),
(323, 'sale', 'ข้าวสาร Q By สหกรณ์การเกษตรกันทรลักษ์', '<p>ข้าวสาร Q</p>\r\n\r\n<p>1) ข้าวเปลือกมาจากข้าวหอมมะลิ GAP ซึ่งมีปริมาณน้อย &nbsp;</p>\r\n\r\n<p>2) ข้าวเปลือก GAP ที่ได้ถูกแยกจัดการต่างหากในโรงสีที่ได้ GMP มีการล้างไลน์การผลิต ก่อนทำข้าว Q&nbsp;</p>\r\n\r\n<p>3) ผลิตภัณฑ์ผ่านการสุ่มตัวอย่างตรวจสอบคุณภาพและความปลอดภัยตามมาตรฐานข้าวหอมมะลิของกระทรวงเกษตรและสหกรณ์</p>\r\n\r\n<p>4) มีระบบ ตรวจสอบ ย้อนกลับ ซึ่งทำให้ท่านได้ทราบข้อมูลของผู้ผลิต</p>\r\n\r\n<p>เพราะเราห่วงใยคุณ.. เราจึงใส่ใจในทุกขั้นตอนการผลิตข้าวสาร Q</p>\r\n', '60.00', 1, '10000.00', 'upload/products/0.40995300 1508493086.jpeg', 'upload/products/0.58575500 1508493088.jpg', 'upload/products/0.66170700 1508493090.jpeg', 'open', '0.00', '0.00', '0.00', '0.00', 'กล่อง', '', ' ทุกจังหวัด', 12, 1769, 198, NULL, NULL, 'A', NULL, 1, 22, 0, '1970-01-01 00:00:00', '1970-01-01 00:00:00', 'year', 'all', '2017-10-20 09:51:31', '2017-11-02 06:50:16', 'HACCP', '1', 1, 9500, 1, 'กิโลกรัม'),
