(502, 'sale', 'ดวงดาว', '<p>จมูกข้าวกล้องงอกผสมธัญพืช</p>\r\n\r\n<p>สินค้าดี มีคุณภาพ ได้รับมาตรฐาน<br />\r\n<br />\r\nขนาดบรรจุ 500 กรัม / แพ็ค</p>\r\n', '120.00', 1, '100.00', 'upload/products/0.12780800 1524044134.jpg', 'upload/products/0.19638700 1524044136.jpg', '', 'open', '0.00', '0.00', '0.00', '0.00', 'กล่อง', '', ' ทุกจังหวัด', 9, 1857, 27, NULL, NULL, '-', NULL, 1, 0, 0, '1970-01-01 00:00:00', '1970-01-01 00:00:00', 'year', 'all', '2018-04-18 09:35:37', '2018-05-17 03:00:41', '', '1', 1, 100, 1, 'กล่อง'),
