(504, 'sale', 'บ้านเห็ดตุ๊กตา', '<p><strong>ลําไย ชื่อวิทยาศาสร์</strong>&nbsp;Dimocarpus longan Lour. (ชื่อพ้องวิทยาศาสตร์ Euphoria longan (Lour.) Steud.) จัดอยู่ในวงศ์เงาะ (<a href="https://medthai.com/tag/SAPINDACEAE/" target="_blank">SAPINDACEAE</a>)</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>ผลไม้เพื่อสุขภาพชนิดนี้เป็นที่นิยมรับประทานอย่างมากในบ้านเรา โดยจังหวัดที่ปลูกมากที่สุดคือจังหวัดลำพูน สำหรับประเทศที่ปลูกมากที่สุดเห็นจะเป็นประเทศจีนที่มีการปลูกลำไยมาถึง 26 สายพันธุ์ แต่ที่นิยมปลูกในบ้านเราจะแบ่งออกเป็น 5 พวก ชนิดแรกคือ ลำไยกะโหลก ซึ่งเป็นพันธ์ุที่มีผลใหญ่ เนื้อหวานอร่อยซึ่งก็จะแบ่งแยกย่อยไปอีกหลายสายพันธุ์ เช่น สีชมพู อีดอ อีแดง อีดำ เป็นต้น ส่วนจำพวกที่ 2-5 ก็คือ ลำไยกระดูก ลำไยสายน้ำผึ้ง ลำไยเถา ลำไยขาว และลำไยธรรมดา</p>\r\n\r\n<p>ลำไยประกอบด้วยวิตามินและแร่ธาตุต่าง ๆ ที่มีประโยชน์ต่อร่างกาย เช่น คาร์โบไฮเดรต โปรตีน ธาตุแคลเซียม ธาตุฟอสฟอรัส ธาตุโซเดียม ธาตุโพแทสเซียม ธาตุทองแดง ธาตุเหล็ก วิตามินซี วิตามินบี 12 เป็นต้น ส่วนในด้านสรรพคุณ ลำไยใช้เป็นยารักษาโรคได้แก่ เป็นยาแก้ท้องร่วง รักษาโรคมาลาเรีย บรรเทาอาการริดสีดวงทวาร เป็นต้น</p>\r\n\r\n<h3>สรรพคุณของลำไย</h3>\r\n\r\n<ol>\r\n	<li>ช่วยให้หลับสบายและช่วยในการเจริญอาหาร</li>\r\n	<li>ช่วยรักษาอาการหวัด ด้วยการนำใบมาชงกับน้ำร้อนดื่ม</li>\r\n	<li>ช่วยรักษาโรคมาลาเรีย ด้วยนำใบสดประมาณ 20 กรัม น้ำ 2 แก้วผสมเหล้าอีก 1 แก้ว นำมาต้มรวมกันให้เดือดจนเหลือน้ำ 1 แก้วแล้วนำมากิน</li>\r\n	<li>ช่วยรักษาแผลเน่าเปื่อย บรรเทาอาการคัน ด้วยนำเมล็ดไปเผาให้เป็นเถ้าแล้วนำมาทา</li>\r\n	<li>ช่วยรักษาอาการท้องร่วง ด้วยการนำเปลือกของต้นที่มีสีน้ำตาลอ่อนใช้ต้มเป็นยา</li>\r\n	<li>ช่วยรักษาโรคริดสีดวงทวาร ด้วยการนำใบลำไยมาชงกับน้ำร้อนดื่ม</li>\r\n	<li>ใช้เป็นยาแก้โรคต่าง ๆ ที่เกี่ยวกับหนอง ด้วยการนำใบสดประมาณ 20 กรัมไปต้มกับน้ำดื่ม</li>\r\n	<li>แก้ปัญหาอาการตกขาว ด้วยการนำรากมาต้มน้ำหรือเคี้ยวให้ค้นผสมกิน</li>\r\n	<li>ช่วยขับพยาธิเส้นด้าย ด้วยการนำรากมาต้มน้ำหรือเคี้ยวให้ค้นผสมกิน</li>\r\n	<li>ช่วยรักษาปัสสาวะขัด ด้วยการนำเมล็ดมาทุบให้แตกแล้วต้มน้ำกิน แต่ต้องลอกเปลือกสีดำออกก่อน</li>\r\n	<li>ดอกลำไยใช้เป็นยาขับปัสสาวะ สลายก้อนนิ่วในไตได้</li>\r\n	<li>แก้อาการวิงเวียนศีรษะอ่อนเพลีย เพิ่มความสดชื่น ด้วยนำเปลือกผลที่แห้งแล้วมาต้มน้ำกิน</li>\r\n	<li>ช่วยรักษาแผลหกล้ม โดนมีดบาด ด้วยการใช้เมล็ดบดเป็นผงแล้วนำมาพอกห้ามเลือด จะช่วยแก้ปวดได้ด้วย แต่ต้องเอาเปลือกสีดำออกก่อน</li>\r\n	<li>ช่วยรักษาแผลไฟไหม้น้ำร้อนลวก ด้วยการนำเปลือกผลที่แห้งแล้วมาเผาเป็นเถ้าหรือบดให้เป็นผงแล้วนำมาโรยที่บาดแผล</li>\r\n	<li>ช่วยรักษาแผลมีหนอง สมานแผล ห้ามเลือด แก้ปวด ด้วยการนำเมล็ดมาต้มหรือบดเป็นผงนำมารับประทาน</li>\r\n	<li>ช่วยรักษากลากเกลื้อน ด้วยการใช้เมล็ดชุบน้ำส้มสายชูที่หมักด้วยข้าวแล้วนำมาถู แต่ทั้งนี้ต้องลอกเปลือกสีดำออกก่อน</li>\r\n	<li>ช่วยรักษาแผลเรื้อรังและมีหนอง ด้วยการนำเมล็ดไปเผาเป็นเถ้า แล้วนำมาผสมกับน้ำมะพร้าวทาบริเวณที่เป็น</li>\r\n	<li>เป็นยาบำรุงม้าม เลือดลม หัวใจ บำรุงร่างกาย นอนไม่หลับ อาการอ่อนเพลีย ด้วยนำเนื้อหุ้มเมล็ดมาต้มน้ำกินหรือนำมาแช่กับเหล้า</li>\r\n	<li>ลำไยอบแห้งมีสารต่อต้านอนุมูลอิสระที่ช่วยยับยั้งสารก่อมะเร็ง</li>\r\n	<li>ช่วยลดอนุมูลอิสระในเม็ดเลือดขาว</li>\r\n</ol>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ol>\r\n	<li>ลำไยมีสารออกฤทธิ์ที่ช่วยฆ่าเซลล์มะเร็งลำไส้ใหญ่ได้</li>\r\n	<li>มีสารช่วยลดการเสื่อมสลายจากข้อเข่า</li>\r\n	<li>ลำไยมีวิตามินบี 12 ที่มีส่วนช่วยในการบำรุงประสาทและสมอง</li>\r\n	<li>ลำไยมีธาตุแคลเซียมสูง มีส่วนช่วยในเรื่องของทำให้กระดูกและฟันแข็งแรง</li>\r\n	<li>ลำไยมีธาตุฟอสฟอรัสที่มีส่วนช่วยบรรเทาอาการปวดจากข้ออักเสบได้</li>\r\n	<li>ลำไยมีธาตุโซเดียม ช่วยให้เส้นประสาทและกล้ามเนื้อทำงานได้อย่างเป็นปกติ</li>\r\n	<li>ลำไยมีธาตุโพแทสเซียมที่มีส่วนช่วยให้มีสติปัญญา จิตใจร่าเริงแจ่มใสได้ โดยการส่งออกซิเจนไปเลี้ยงที่สมอง</li>\r\n	<li>ลำไยมีธาตุเหล็กซึ่งช่วยป้องกันอาการอ่อนเพลียของร่างกาย</li>\r\n	<li>ลำไยมีแร่ธาตุทองแดงที่มีส่วนช่วยให้ร่างกายมีพลังงาน โดยการช่วยให้ร่างกายดูดซึมธาตุเหล็กได้อย่างมีประสิทธิภาพ</li>\r\n</ol>\r\n\r\n<h3>ประโยชน์ของลำไย</h3>\r\n\r\n<ol>\r\n	<li>ใช้รับประทานสดเป็นผลไม้ในยามว่าง อร่อยมาก ๆ</li>\r\n	<li>น้ำลำไยช่วยเพิ่มความสดชื่นให้แก่ร่างกาย</li>\r\n	<li>ใช้ทำเป็นอาหารก็ได้ เช่น ข้าวเหนียวเปียกลำไย ลำไยลอยแก้ว วุ้นลำไย เป็นต้น</li>\r\n	<li>ลําไยเป็นผลไม้ที่ให้พลังงานสูงมาก เนื่องจากมีน้ำตาลหรือคาร์โบไฮเดรตในปริมาณมาก</li>\r\n	<li>ลําไยมีวิตามินซีที่มีส่วนช่วยในการบำรุงผิวและเป็นสารต่อต้านอนุมูลอิสระ</li>\r\n	<li>มีความเป็นไปได้ว่าในอนาคตอาจนำมาใช้ในการรักษาโรคมะเร็ง เพราะไม่มีผลข้างเคียง ซึ่งจะทำให้ลดขนาดการใช้ยาหรือเคมีบำบัดลงได้มาก</li>\r\n	<li>ลำไยแห้งมีส่วนช่วยยับยั้งการสร้างเม็ดสีผิวได้ดีกว่าการใช้สารเคมี</li>\r\n	<li>ลําไยสามารถนำมาแปรรูปได้หลากหลาย เช่น การบรรจุกระป๋อง ลำไยอบแห้ง น้ำลำไย เป็นต้น</li>\r\n	<li>เนื้อไม้สีแดงของต้นลำไยมักนิยมนำมาใช้เป็นเครื่องประดับ</li>\r\n</ol>\r\n\r\n<p>คุณค่าทางโภชนาการของลำไย ต่อ 100 กรัม</p>\r\n\r\n<ul>\r\n	<li>พลังงาน 60 กิโลแคลอรี</li>\r\n	<li><img alt="ประโยชน์ของลำไย" src="https://medthai.com/wp-content/uploads/2013/07/Longan-2.jpg" style="height:312px; width:180px" />คาร์โบไฮเดรต 15.14 กรัม</li>\r\n	<li>เส้นใย 1.1 กรัม</li>\r\n	<li>ไขมัน 0.12 กรัม</li>\r\n	<li>โปรตีน 1.31 กรัม</li>\r\n	<li>วิตามินบี 1 0.031 มิลลิกรัม 3%</li>\r\n	<li>วิตามินบี 2 0.14 มิลลิกรัม 12%</li>\r\n	<li>วิตามินบี 3 0.3 มิลลิกรัม 2%</li>\r\n	<li>วิตามินซี 84 มิลลิกรัม 101%</li>\r\n	<li>ธาตุแคลเซียม 1 มิลลิกรัม 0%</li>\r\n	<li>ธาตุเหล็ก 0.13 มิลลิกรัม 1%</li>\r\n	<li>ธาตุแมกนีเซียม 10 มิลลิกรัม 3%</li>\r\n	<li>ธาตุแมงกานีส 0.052 มิลลิกรัม 2%</li>\r\n	<li>ธาตุฟอสฟอรัส 21 มิลลิกรัม 3%</li>\r\n	<li>ธาตุโพแทสเซียม 266 มิลลิกรัม 6%</li>\r\n	<li>ธาตุโซเดียม 0 มิลลิกรัม 0%</li>\r\n	<li>ธาตุสังกะสี 0.05 มิลลิกรัม 1%</li>\r\n</ul>\r\n\r\n<p>% ร้อยละของปริมาณแนะนำที่ร่างกายต้องการในแต่ละวันสำหรับผู้ใหญ่ (ข้อมูลจาก :&nbsp;<a href="http://ndb.nal.usda.gov/ndb/foods/show/2284?qlookup=09172&amp;format=Full&amp;max=25&amp;man=&amp;lfacet=&amp;new=1" target="_blank">USDA Nutrient database</a>)</p>\r\n\r\n<p>คำแนะนำ&nbsp;: ไม่ควรรับประทานลำไยมากเกินไป เพราะอาจทำให้เกิดอาการร้อนใน เกิดแผลในช่องปาก และตาแฉะได้ ดังนั้นควรรับประทานแต่พอดี และผู้ที่มีอาการเจ็บคอ ไอมีเสมหะ มีหนองเป็นแผลอักเสบ ก็ไม่ควรรับประทานลำไย</p>\r\n', '50.00', 1, '100.00', 'upload/products/0.61081900 1525231624.jpg', '', '', 'open', '0.00', '0.00', '0.00', '0.00', 'กิโลกรัม', '', ' ทุกจังหวัด', 2, 643, 457, NULL, NULL, 'A', NULL, NULL, 39, 0, '2018-05-02 00:00:00', '2018-05-04 00:00:00', 'peri', 'retail', '2018-05-02 03:27:05', '2018-05-16 14:47:36', '', '2', 1, 99, -1, NULL),
