(513, 'sale', 'chatsuda de amphawa', '<p>น้ำมันมะพร้าว เป็นน้ำมันที่ได้จากไขมันในเนื้อสีขาวของลูกมะพร้าว โดยอาจผลิตด้วยกระบวนการที่แตกต่างหลากหลาย บางผลิตภัณฑ์ใช้คำว่าน้ำมันมะพร้าวบริสุทธิ์ (Virgin Coconut Oil) ซึ่งหมายถึงน้ำมันมะพร้าวที่สกัดโดยใช้กระบวนการธรรมชาติ เช่น ปราศจากสารฟอกสี การระงับกลิ่น หรือการกลั่น และบางครั้งระบุว่าใช้กระบวนการสกัดเย็น อันเป็นวิธีใช้เครื่องสกัดที่จะทำให้เกิดความร้อนตามธรรมชาติไม่เกิน 49 องศาเซลเซียสมากที่สุด สามารถรับประทานเพื่อดีท็อกลำไส้ บำรุงผิว บำรุงงเส้นผม ได้อย่างีประสิทธิภาพ</p>\r\n', '300.00', 1, '20.00', 'upload/products/0.99900800 1526033661.jpg', '', '', 'open', '0.00', '0.00', '0.00', '0.00', 'ขวด', '', ' ทุกจังหวัด', 9, 1859, 865, NULL, NULL, '-', NULL, 500, 60, 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00', 'year', 'retail', '2018-05-11 10:14:23', '2018-05-11 10:14:23', '', '1', 1, 20, 1, 'มิลลิลิตร'),
