(519, 'sale', 'ตราลิ้นจี่', '<p>ราคาไม่รวมค่าขนส่ง สนใจสอบถามได้ เราจะหาช่องทางขนส่งที่ถูกที่สุดให้ค่ะ</p>\r\n\r\n<p>ข้าวอินทรีย์แท้ ผ่านมาตรฐาน Organic Thailand จากกรมการข้าว มีกลิ่นหอมอ่อนๆ นุ่ม ไม่แข็ง ทำให้ทานง่าย</p>\r\n\r\n<p>ข้าวคุณภาพดีๆ คนขายก็ใจดีด้วยนะ ^_^</p>\r\n\r\n<p>ซื้อปริมาณมาก เกิน 100 กก. สอบถามราคาพิเศษได้เลยจ้า</p>\r\n', '60.00', 1, '3000.00', 'upload/products/0.18383800 1526964928.jpeg', 'upload/products/0.51199700 1526964930.jpg', 'upload/products/0.73074400 1526964932.jpg', 'open', '0.00', '0.00', '0.00', '0.00', 'กิโลกรัม', '', ' ทุกจังหวัด', 12, 1464, 1013, NULL, NULL, '-', NULL, 1, 7, 0, '1970-01-01 00:00:00', '1970-01-01 00:00:00', 'year', 'all', '2018-05-22 04:55:33', '2018-05-22 05:14:22', '', '1', 1, 3000, 1, 'กิโลกรัม'),
(520, 'buy', '', '', '0.00', 0, '0.00', '', '', '', 'open', '50.00', '300.00', '10.00', '0.00', 'กิโลกรัม', '', ' ทุกจังหวัด', 2, 1862, 1047, NULL, NULL, '-', NULL, NULL, NULL, 0, NULL, NULL, NULL, NULL, '2018-05-22 05:38:32', '2018-05-22 05:48:14', '', '', 0, 0, -1, NULL),
(521, 'sale', 'ฟาร์มสิริน', '<p>ข้าวขาวน้ำตาลต่ำเหมาะสำหรับผู้ป่วยเบาหวานหรือผู้ต้องการควบคุมน้ำหนัก มีรสชาดอร่อย นุ่ม หอม</p>\r\n', '50.00', 1, '3000.00', 'upload/products/0.59421400 1526971334.jpg', '', '', 'open', '0.00', '0.00', '0.00', '0.00', 'กิโลกรัม', '', ' ทุกจังหวัด', 12, 1852, 496, NULL, NULL, 'A', NULL, 1, 52, 0, '1970-01-01 00:00:00', '1970-01-01 00:00:00', 'year', 'retail', '2018-05-22 06:38:40', '2018-06-06 05:49:09', '', '1', 1, 3000, 1, 'กิโลกรัม'),
(522, 'sale', 'Feel Plus (ฟีลพลัส)', '<p><strong>เต้าฮวยมะพร้าวอ่อน เชค&nbsp;</strong>ทำจากน้ำมะพร้าวและเนื้อมะพร้าวอ่อนแท้ 100% รสชาติหอมหวานมัน ช่วยคลายร้อนและดับกระหายได้อย่างดี <strong>ยิ่งเขย่ายิ่งอร่อย</strong> ไม่จำเป็นต้องใช้ช้อนตักอีกต่อไป ใช้วิธีการเขย่าเพื่อให้เนื้อเต้าฮวยแตก จะยกดื่มหรือจะใช้หลอดดูดก็อร่อยได้ง่ายๆ</p>\r\n\r\n<p><strong>น้ำมะพร้าวพร้อมดื่ม</strong> ทำจากน้ำมะพร้าวน้ำหอม 100% ดื่มดับร้อนและดับกระหายได้เป็นอย่างดี เหมือนดื่มน้ำมะพร้าวสดๆ จากลูกมะพร้าว</p>\r\n', '25.00', 1, '100.00', 'upload/products/0.76803600 1526971817.jpg', '', '', 'open', '0.00', '0.00', '0.00', '0.00', 'ขวด', '', 'กรุงเทพมหานคร   ', 9, 333, 976, NULL, NULL, '-', NULL, 250, 1, 1, '0000-00-00 00:00:00', '0000-00-00 00:00:00', 'year', 'all', '2018-05-22 06:50:18', '2018-05-22 06:50:18', 'กำลังดำเนินการขอ อย', '10', 1, 100, 1, 'มิลลิลิตร');
