(525, 'sale', 'ทองระยอง', '<p>1 กล่อง บรรจุ 3 ลูก ราคา 100 บาท (ค่าส่งเคอรี่กล่องละ 100)</p>\r\n', '100.00', 1, '1000.00', 'upload/products/0.00188800 1527060450.jpg', 'upload/products/0.05228800 1527060452.jpg', '', 'open', '0.00', '0.00', '0.00', '0.00', 'กล่อง', '', ' ทุกจังหวัด', 2, 907, 1061, NULL, NULL, 'A', NULL, 1, 0, 0, '1970-01-01 00:00:00', '1970-01-01 00:00:00', 'year', 'retail', '2018-05-23 07:27:33', '2018-05-23 07:55:04', '', '3', 1, 1000, 1, 'กล่อง'),
(526, 'sale', 'เห็ดกริ๊ก', '<p>เห็ดทอดสมุนไพร เกษตรอินทรีย์ Fricd mushroom organic</p>\r\n\r\n<p>ส่วนประกอบ&nbsp;</p>\r\n\r\n<p>เห็ดนางฟ้า 70%</p>\r\n\r\n<p>แป้งสาลี 16%</p>\r\n\r\n<p>น้ำตาล 10%</p>\r\n\r\n<p>งาขาว 2%</p>\r\n\r\n<p>เกลือ 1%</p>\r\n\r\n<p>ตะไคร้ 0.4%</p>\r\n\r\n<p>ใบมะกรูด 0.3%</p>\r\n\r\n<p>ใบกะเพรา 0.3%</p>\r\n', '35.00', 1, '1000.00', 'upload/products/0.28110800 1527236911.jpg', 'upload/products/0.46263300 1527236913.jpg', 'upload/products/0.56980300 1527236915.jpg', 'open', '0.00', '0.00', '0.00', '0.00', 'ซอง', '', ' ทุกจังหวัด', 9, 1617, 1077, NULL, NULL, '-', NULL, 60, 22, 0, '1970-01-01 00:00:00', '1970-01-01 00:00:00', 'year', 'all', '2018-05-25 08:16:49', '2018-05-25 08:28:36', 'อย.3320456060006', '1', 1, 1000, 1, 'กรัม'),
