(530, 'sale', 'ไร่จันทร์เรือง', '<p>ทุเรียนทอดไร่จันทร์เรือง&nbsp; รสธรรมชาติ (Crispy Durian Chips : Original Flavor)&nbsp;น้ำหนัก 35 กรัม<br />\r\n<img alt="????" src="https://static.xx.fbcdn.net/images/emoji.php/v9/zb0/1/16/1f3af.png" /> ทุเรียนพันธุ์หมอนทอง<br />\r\n&nbsp; &nbsp; &nbsp;<img alt="????" src="https://static.xx.fbcdn.net/images/emoji.php/v9/za/1/16/1f343.png" /> ปลอดสารพิษ<br />\r\n<img alt="????" src="https://static.xx.fbcdn.net/images/emoji.php/v9/zb0/1/16/1f3af.png" /> กรรมวิธีการผลิต <img alt="????????" src="https://static.xx.fbcdn.net/images/emoji.php/v9/z8d/1/16/1f449_1f3fc.png" /> ทอด <img alt="????????" src="https://static.xx.fbcdn.net/images/emoji.php/v9/z8d/1/16/1f449_1f3fc.png" /> อบ เพื่อเป่าน้ำมันด้วยลมร้อน<br />\r\n&nbsp; &nbsp; &nbsp;<img alt="✅" src="https://static.xx.fbcdn.net/images/emoji.php/v9/z33/1/16/2705.png" /> ไขมันต่ำ (Low Fat)<br />\r\n&nbsp; &nbsp; &nbsp;<img alt="✅" src="https://static.xx.fbcdn.net/images/emoji.php/v9/z33/1/16/2705.png" /> ไม่ใส่สารกันเสีย (No Preservatives)<br />\r\n&nbsp; &nbsp; &nbsp;<img alt="✅" src="https://static.xx.fbcdn.net/images/emoji.php/v9/z33/1/16/2705.png" /> ไม่เจือสีสังเคราะห์ (No Color Added)<br />\r\n<img alt="????" src="https://static.xx.fbcdn.net/images/emoji.php/v9/zb0/1/16/1f3af.png" /> ผ่านการรับรอง<br />\r\n&nbsp; &nbsp; &nbsp;<img alt="✅" src="https://static.xx.fbcdn.net/images/emoji.php/v9/z33/1/16/2705.png" /> Primary GMP<br />\r\n&nbsp; &nbsp; &nbsp;<img alt="✅" src="https://static.xx.fbcdn.net/images/emoji.php/v9/z33/1/16/2705.png" /> อย.&nbsp;<strong>22-2-01359-6-001&nbsp;</strong><br />\r\n<img alt="????" src="https://static.xx.fbcdn.net/images/emoji.php/v9/zb0/1/16/1f3af.png" /> สินค้าเก็บได้ 4-6 เดือน (บนถุงมีวัน เดือน ปี ที่ผลิตและหมดอายุ)<br />\r\n<img alt="????" src="https://static.xx.fbcdn.net/images/emoji.php/v9/zb0/1/16/1f3af.png" /> ไม่อมน้ำมัน<br />\r\n<img alt="????" src="https://static.xx.fbcdn.net/images/emoji.php/v9/zb0/1/16/1f3af.png" /> ไม่เหม็นหืน</p>\r\n\r\n<p>จัดส่ง SCG Express ฟรีทั่วประเทศ</p>\r\n', '89.00', 1, '20.00', 'upload/products/0.37534600 1528255341.jpg', 'upload/products/0.46821900 1528255343.jpg', 'upload/products/0.56248800 1528255345.jpg', 'open', '0.00', '0.00', '0.00', '0.00', 'ถุง', '', ' ทุกจังหวัด', 9, 1700, 1063, NULL, NULL, 'A', NULL, 1, 13, 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00', 'year', 'retail', '2018-06-06 03:22:26', '2018-06-06 03:22:26', 'อย.', '5', 1, 20, 1, 'ถุง'),
(531, 'sale', 'สวนถนอมจิต', '<p>ส้มโอขาวใหญ่&nbsp;ซึ่งเป็นพันธุ์ดั้งเดิมของจังหวัดสมุทรสงคราม &nbsp;&nbsp;มีลักษณะเด่นคือ ไม่มีเมล็ด กุ้ง (กลีบของเนื้อส้มโอ) เป็นสีน้ำผึ้ง เป็นที่ชื่นชอบของผู้บริโภคเนื่องจากมีรสชาติอร่อย ที่สำคัญจังหวัดสมุทรสงครามยังให้ความสำคัญกับการปรับปรุงคุณภาพให้เป็นส้มโอปลอดสารพิษ ซึ่งจะปลอดภัยแก่ผู้บริโภค ส้มโอขาวใหญ่ จะมีผลใหญ่ รูปร่างสวยงามค่อนข้างแป้น กุ้งมีสีเหลืองอ่อนจนถึงสีน้ำตาล ปึกอมชมพูนิดหน่อยพองามเกาะตัวแน่นไม่หลุดร่วงง่ายมีรสชาติดี หวานกลมกล่อมอมเปรี้ยว เล็กน้อย โดยเฉพาะอย่างยิ่งมีกลิ่นหอมที่เป็นเอกลักษณ์เฉพาะตัว อย่างมีเสน่ห์ลึกลับ ไม่แห้งแต่ ไม่แฉะ นับเป็นความลงตัวที่สมบูรณ์แบบของส้มโอพันธุ์ขาวใหญ่ นอกจากนั้นยังแกะออกจากเปลือก ง่าย มีเมล็ดน้อย บางครั้งก็ไม่มีเมล็ดเลย และเมื่อรับประทานแล้วยังชุ่มคออีกด้วย จึงเป็นผลไม้ที่ ถูกปากถูกคอผู้บริโภค จนทำให้ใครต่อใครพากันถามหาเป็นของฝากของกำนัลญาติสนิทมิตรสหาย&nbsp;&nbsp;&nbsp;</p>\r\n', '150.00', 1, '50.00', 'upload/products/0.30714000 1528269749.jpg', 'upload/products/0.36954300 1528269751.jpg', 'upload/products/0.40109300 1528269753.jpg', 'open', '0.00', '0.00', '0.00', '0.00', 'ลูก', '', ' ทุกจังหวัด', 2, 1865, 1114, NULL, NULL, 'A', NULL, NULL, 60, 0, '2018-07-20 00:00:00', '2018-09-10 00:00:00', 'peri', 'all', '2018-06-06 07:22:34', '2018-06-06 07:22:34', '', '1', 1, 50, -1, NULL),
(532, 'sale', '', '<p>ขายมะม่วงเขียวใหญ่ ตอนนี้มีประมาณ 2,000 กิโลกรัม ห่อ ผิวสวย ไร้สารพิษตกค้าง เพราะไม่มีเงินซื้อสารเคมีกำจัดแมลง ขายกิโลกรัมละ 30 บาท ส่งทั่วไทย คิดค่าส่งตามน้ำหนักจริง สั่งในเมืองเชียงใหม่คิดค่าส่งตามระยะทาง</p>\r\n', '30.00', 1, '2000.00', 'upload/products/0.50657900 1528365624.jpg', '', '', 'open', '0.00', '0.00', '0.00', '0.00', 'กิโลกรัม', '', ' ทุกจังหวัด', 2, 852, 960, NULL, NULL, 'A', NULL, 1, 38, 0, '1970-01-01 00:00:00', '1970-01-01 00:00:00', 'year', 'all', '2018-06-07 10:00:25', '2018-06-07 10:01:38', '', '100', 1, 0, 1, 'ตระกร้า');
