INSERT INTO `promotions` (`id`, `shop_id`, `promotion_title`, `promotion_description`, `image_file`, `start_date`, `end_date`, `is_active`, `sequence`) VALUES
(1, 8, 'ข้าวไรซ์เบอรี่ SUNFOOD ซื้อ 5 กิโลกรัมขึ้นไป จัดส่งฟรี', 'ข้าวไรซ์เบอรี่ SUNFOOD 1 กิโลกรัม 65 บาท ถ้าซื้อ 5 กิโลกรัมขึ้นไป เหลือกิโลกรัมละ 60 บาท พร้อมจัดส่งฟรี ', NULL, '2017-11-01', '2017-12-31', 1, 999),
(2, 72, 'ลดพิเศษช่วงเทศกาลปีใหม่ 10%', 'ลด 10% ทุกรายการก่อน 25/12/17 นี้', NULL, '2017-12-20', '2017-12-25', 1, 999),
(3, 87, 'ซื้อกล้วยน้ำว้า 30 หวี ฟรีค่าส่ง', 'ซื้อกล้วยน้ำว้า 30 หวี ฟรีค่าส่ง', 'upload/promotion/1516161016.jpg', '2018-01-17', '2018-02-10', 1, 999),
(4, 91, 'มะพร้าวกะทิแช่แข็ง', ' โปรโมชั่นน ! \r\n\r\n- มะพร้าวกะทิแบบแคะเนื้อ ลด‼️‼️จาก กกละ 220 เหลือ 210 บาท\r\n- มะพร้าวกะทิแบบลูก คละไซส์ เหลือลูกละ 100 บาท ‼️‼️\r\n* ขั่นต่ำสำหรับ 20 ลูกขึ้นไป ( ไม่รวมค่าขนส่ง )\r\n\r\n*สินค้ามีมาตลอดนะจ่ะ\r\n**รับประกันคุณภาพ เนื้อแน่น ฟู สด ไร', 'upload/promotion/1517912008.jpg', '2018-02-07', '2018-03-31', 1, 999),
(6, 102, 'โปรโมชั่นแจกแถม', 'ซื้อสินค้าข้าว ตรา Qrice ครบ 1000 บาท แถม ข้าวสามกษัตรย์ 1 กล่อง (ขนาด 1.5 กรัม)\r\nซื้อสินค้าข้าว ตรา นกกระเรียน ครบ 1000 บาท แถม ปลากระป๋อง 5 กระป๋อง', NULL, '2018-01-01', '2018-04-30', 1, 999);
