(12, 158, 'ข้าวอินทริย์ปลอดสารพิษ  ข้าวสามหอม (ตราข้าวลูกสาว)', '1.ชื่อสินค้า.ข้าวลูกสาว,ข้าวสามหอมเป็นข้าวเพื่อสุขภาพ หอมนุ่มสะอาดถูกหลักอนามัยประโยชน์ต่อสุขภาพ ', ' 2.คุณลักษณะ-คุณสมบัติ.เราปลูกข้าวใช้ปุ๋ยธรรมชาติเป็นข้าวที่คัดสรรข้าวไรซ์เบอร์รี่ 5ดาว ,ข้าวหอมมะลิแดง 4 ดาว ,ข้าวหอมมะลิ105 4ดาว คัดด้วยมือ  ปลูกเอง สีเอง ขายเอง\r\n3.เรื่องราวที่มาของสินค้า. ปลูกข้าวเพื่อสุขภาพให้ลูกสุขภาพดีและต่อผู้ดูเเลสุขภาพเป็นข้าวอินทริย์ปลูกมาแล้ว7ปี  ปุ๋ยที่ใช้เป็นธรรมชาติจากปุ๋ยสดต้นปอเทือง\r\n', '', '', '', 'theme3', '2017-09-20 09:22:08', '2017-10-06 13:05:56', 'Monchawal', '#000000', ''),
