(18, 175, 'ฟาร์มสายทอง แหล่งท่องเที่ยวเชิงเกษตร ศูนย์การเรียนรู้ เกษตรอินทรีย์', 'แหล่งผลิตมัลเบอร์รี่ปลอดสารเคมีแห่งเดียวใน อ.มวกเหล็ก จังหวัดสระบุรี', 'มัลเบอร์รี่ (Mulberry) หรือ หม่อน (ภาคอีสานเรียกว่า “มอน”) ที่เรารู้จักกันจะมีอยู่ 2 ชนิด คือ หม่อนหรือมัลเบอร์รี่ชนิดที่ปลูกไว้เพื่อรับประทานผลเพียงอย่างเดียว ซึ่งมีชื่อสามัญว่า Black Mulberry และมีชื่อวิทยาศาสตร์ Morus nigra L. จัดอยู่ในวงศ์ MORACEAE ผลสุกจะเป็นสีดำมีรสเปรี้ยวอมหวาน นิยมนำมารับประทานและนำไปแปรรูปเป็นผลิตภัณฑ์ต่าง ๆ\r\nส่วนอีกชนิด คือ หม่อนที่ปลูกไว้เพื่อการเลี้ยงไหมเป็นหลัก มีชื่อสามัญว่า White Mulberry และมีชื่อวิทยาศาสตร์ Morus alba L. ชนิดนี้ใบจะมีขนาดใหญ่กว่าและออกใบมากกว่า ใช้เป็นอาหารเลี้ยงไหมได้ดี แต่ผลจะมีขนาดเล็กกว่า เมื่อสุกจะมีรสเปรี้ยว ใช้รับประทานได้เช่นกัน แต่ไม่เป็นที่นิยมเท่าชนิดแรก และยังมีชนิดอื่น ๆ อีกหลายชนิดครับ เช่น Red Mulberry ที่มีชื่อวิทยาศาสตร์ว่า Morus rubra L. เป็นต้น\r\n\r\nสรรพคุณของมัลเบอร์รี่\r\n1.ผลมัลเบอร์รี่มีรสเปรี้ยวหวานเย็น มีสรรพคุณช่วยดับร้อน คายความร้อนรุ่ม ช่วยขับลมร้อน ช่วยบรรเทาอากากระหายน้ำ ทำให้ชุ่มคอ และทำให้ร่างกายชุ่มชื่น\r\n2.ผลนำมาต้มกับน้ำหรือเชื่อมกินเป็นยาแก้ธาตุไม่ปกติ\r\n3.ผลมีสรรพคุณช่วยบำรุงหัวใจ\r\n4.มัลเบอร์รี่มีสรรพคุณช่วยทำให้เส้นประสาทตาดี ทำให้สายตาแจ่มใส หูตาสว่าง ร่างกายสุขสบาย\r\n5.ผลมีสรรพคุณช่วยแก้อาการท้องผูก และยังมีเมล็ดที่ช่วยเพิ่มใยอาหาร\r\n6.ผลนำมาต้มกับน้ำหรือเชื่อมกินเป็นยาระบายอ่อนๆ\r\n7.ผลมัลเบอร์รี่มีฤทธิ์เป็นยาเย็น ออกฤทธิ์ต่อตับและไต มีสรรพคุณช่วยบำรุงตับและไต ช่วยรักษาตับและไตพร่อง\r\n8.ช่วยแก้ข้อมูลข้อเท้าเกร็ง แก้ไขข้อ โรคปวดข้อ\r\n9.ช่วยบำรุงเส้นผมให้ดกดำ ป้องกันผมหงอกก่อนวัย\r\n10ในประเทศจีนจะใช้ผล กิ่งอ่อน เปลือกราก และใบเป็นยาบำรุงกำลัง รักษาโรคเกี่ยวกับทรวงอก แก้ไอ หืด วัณโรคปอด การสะสมน้ำในร่างกายผิดปกติ ขับปัสสาวะ และรักษาโรคปวดข้อ\r\nหมายเหตุ : การตามข้อ2. ใช้ผลแห้งให้ใช้ครั้งละ 10-15 กรัม นำมาต้มกับน้ำรับประทาน หรือใช้เข้าตำรับยาตามตามต้องการ (ตามตำรับยาระบุให้ใช้ผลหม่อนหรือผลมัลเบอร์รี่ ชนิดที่มีชื่อวิทยาศาสตร์ว่า Morus alba L.)\r\n\r\nประโยชน์ของมัลเบอร์รี่\r\n1.มัลเบอร์รี่มีสาร Anthocyanins ในปริมาณมาก โดยสารชนิดนี้เป็นสารต้านอนุมูลอิสระที่มีประโยชน์หลายอย่าง เช่น ช่วยลดความเสี่ยงของการเกิดโรคหลอดเลือดหัวใจอุดตัน ต่อต้านอาการขาดเลือดในสมอง ป้องกันการเกิดโรคมะเร็ง เป็นต้น\r\n2.มัลเบอร์รี่มีสาร Deoxynojirimycin ที่เป็นตัวช่วยลดระดับน้ำตาลในเลือดได้\r\n3.มัลเบอร์รี่มีกาบา (GABA) ที่เป็นตัวช่วยลดความโลหิต\r\n4.มัลเบอร์รี่มีสาร Phytosterol ที่สามารถช่วยลระดับคอเลสเตอรอลได้\r\n5.มัลเบอร์รี่มีสาร Polyphenols ซึ่งเป็นสารต้านอนุมูลอิสระที่มีประโยชน์กับร่างกาย\r\n6.สารประกอบฟีนอลในมีอยู่ในผลมัลเบอร์รี่ สามารถช่วยต้านอนุมูลอิสระ ต้านอาการอักเสบ อาการเส้นเลือดโป่งพอง และยับยั้งเชื้อแบคทีเรียและเชื้อไวรัสได้\r\n7.สาร Quercetin และสาร Kaempferol ที่มีอยู่ในผลมัลเบอร์รี่เป็นสารในกลุ่มฟลาโวนอยด์ ที่สามารถช่วยลดความเสี่ยงของการเกิดโรคหัวใจ โรคความดันโลหิต ช่วยทำให้หลอดเลือดแข็งแรง เลือดหมุนเวียนดี ป้องกันการเกิดลิ่มเลือดในหลอดเลือด ป้องกันการดูดซึมของน้ำตาลในลำไส้เล็ก ยับยั้งการเกิดสารก่อมะเร็งเม็ดเลือด มะเร็งเต้านม มะเร็งลำไส้ใหญ่ ช่วยยืดอายุเม็ดเลือดขาว และลดอาการแพ้ต่างๆ\r\n8.มีวิตามินเอที่ช่วยในด้านการบำรุงสายตา ป้องกันการเกิดต้อกระจก ช่วยบำรุงเหงือกและฟัน บำรุงผิวพรรณ และลดการอักเสบของสิว\r\n9.วิตามินบี6 ในผลมัลเบอร์รี่ มีประโยชน์ในด้านการบำรุงเลือด ตับ และไต ช่วยลดอาการปวดประจำเดือน และลดการเกิดสิว\r\n10.มัลเบอร์รี่มีวิตามินซีสูง ที่เป็นตัวช่วยป้องกันหวัด ภูมิแพ้ วัณโรค โรคปอด เชื้อไวรัส และช่วยเสริมสร้างภูมิต้านทานให้แก่ร่างกาย\r\n11.มัลเบอร์รี่กรดโฟลิกสูง ซึ่งกรดโฟลิกนั้นสามารถช่วยทำให้เซลล์เม็ดเลือดแดงเจริญได้เต็มที่ ทำให้เซลล์ประสาทไขสันหลังและเซลล์สมองเจริญเป็นปกติ และช่วยป้องกันโรคโลหิตจาง\r\n12.นอกจากนี้ลูกมัลเบอร์รี่ยังกรดอะมิโน วิตามินและแร่ธาตุอีกหลายชนิดที่เป็นประโยชน์ต่อร่างกาย เช่น วิตามินเอ วิตามินบี แคลเซียม ธาตุเหล็ก โพแทสเซียม แมกนีเซียม โซเดียม สังกะสี ฯลฯ\r\n13.บางรายงานระบุว่ามัลเบอร์รี่สามารถช่วยแก้อาการเมาค้าง และช่วยผ่อนคลายความเครียดได้\r\n14.ผลมัลเบอร์รี่สามารถนำมาแปรรูปเป็นอาหารหรือผลิตภัณฑ์ได้หลายชนิด เช่น แยมหม่อน เยลลี่หม่อน ขนมพาย ข้าวเกรียบ ไอศกรีมหม่อน หม่อนแช่อิ่ม หม่อนอบแห้ง ลูกอมหม่อน น้ำหม่อน ไวน์หม่อน เป็นต้น\r\n\r\nคุณค่าทางโภชชนาการของมัลเบอร์รี่ ต่อ 100 กรัม\r\n-พลังงาน 43 กิโลแคลอรี่\r\n-คาร์โบไฮเดรต 9.8 กรัม\r\n-น้ำตาล 8.1 กรัม\r\n-ใยอาหาร 1.7 กรัม\r\n-ไขมัน 0.39 กรัม\r\n-โปรตีน 1.44 กรัมMulberry\r\n-เถ้า 0.69 กรัม\r\n-วิตามินเอ 25 หน่วยสากล\r\n-เบต้าแคโรทีน 9 ไมโครกรัม\r\n-ลูทีน และ ซีแซนทีน 136 ไมโครกรัม\r\n-วิตามินบี1 0.029 มิลลิกรัม (3%)\r\n-วิตามินบี2 0.101 มิลลิกรัม (8%)\r\n-วิตามินบี3 0.62 มิลลิกรัม (4%)\r\n-วิตามินบี6 0.05 มิลลิกรัม (4%)\r\n-วิตามินบี9 6 ไมโครกรัม (2%)\r\n-วิตามินซี 36.4 มิลลิกรัม (44%)\r\n-วิตามินอี 0.87 มิลลิกรัม\r\n-วิตามินเค 7.8 ไมโครกรัม\r\n-โคลีน 12.3 มิลลิกรัม (3%)\r\n-แคลเซียม 39 มิลลิกรัม (4%)\r\n-ธาตุเหล็ก 1.85 มิลลิกรัม (14%)\r\n-แมกนีเซียม 18 มิลลิกรัม (5%)\r\n-ฟอสฟอรัส 38 มิลลิกรัม (5%)\r\n-โพแทสเซียม 194 มิลลิกรัม (4%)\r\n-โซเดียม 10 มิลลิกรัม (1%)\r\n-สังกะสี 0.12 มิลลิกรัม (1%)\r\n-ทองแดง 0.06 มิลลิกรัม\r\n-ซีลีเนียม 0.6 ไมโครกรัม\r\n% ร้อยละของปริมาณแนะนำที่ร่างกายต้องการในแต่ละวันสำหรับผู้ใหญ่ (ข้อมูลจาก : USDA Nutrient database)\r\n', '', '', '', 'theme3', '2017-10-09 18:06:03', '2017-10-09 18:06:21', 'Saithongfarm', '#000000', 'ชื่อบัญชี : นาย นที  จงจินารี\r\nธนาคารกรุงเทพ : 181-4-88387-0\r\nธนาคารไทยพาณิช : 160-2-51627-5\r\nธนาคารกสิกรไทย : 077-2-25133-7\r\n'),
