(32, 198, 'ข้าวสาร Q', '...ปลูกด้วยรัก คัดด้วยใจ ห่วงใยคุณ...', 'เพราะเราห่วงใยคุณ.. เราจึงใส่ใจในทุกขั้นตอนการผลิตข้าวสาร Q\r\n1) ข้าวเปลือกมาจากข้าวหอมมะลิ GAP ซึ่งมีปริมาณน้อย ข้าวส่วนใหญ่ไม่ได้ปลูกตามหลักการนี้มักใช้สารเคมีมากเกินพอกำหมด \r\n\r\n2) ข้าวเปลือก GAP ที่ได้ถูกแยกจัดการต่างหากในโรงสีที่ได้ GMP มีการล้างไลน์การผลิต ก่อนทำข้าว Q \r\n\r\n3) ผลิตภัณฑ์ผ่านการสุ่มตัวอย่างตรวจสอบคุณภาพและความปลอดภัยตามมาตรฐานข้าวหอมมะลิของกระทรวงเกษตรและสหกรณ์\r\n\r\n4) มีระบบ ตรวจสอบ ย้อนกลับ ซึ่งทำให้ท่านได้ทราบข้อมูลของผู้ผลิต\r\n\r\nเพื่อให้คุณ และคนที่คุณรักได้รับประทานข้าว ที่ได้คุณภาพทั้งระบบ ', '', '', '', 'theme3', '2017-10-20 09:01:58', '2017-10-20 10:09:42', 'QricebyKantharalak', '#ffffff', '0178278134 สหกรณ์การเกษตรกันทรลักษ์ ธนาคารกสิกรไทย สาขากันทรลักษ์'),
