(76, 329, '"Thai Organics shop" ร้านจำหน่ายสินค้าเกษตรอินทรีย์ออนไลน์', 'ยินดีต้อนรับทุกท่าน สู่ ออแกนิคแลนด์ พื้นที่จำหน่ายสินค้าเกษตรอินทรีย์ เพื่อคนรักสุขภาพ (Organic Healthy product shop)', 'สินค้าและผลิตภัณฑ์ของร้านเรา ผลิต แปรรูป ด้วยระบบเกษตรอินทรีย์ ใส่ใจคุณภาพ เพื่อส่งมอบสินค้าที่ดี มีคุณภาพสู่มือผู้บริโภค มีหลากหลายแบรนด์ อาทิ สวนสวรรค์, เอื้องหลวง ฯลฯ เป็นพื้นที่สำหรับ คนรักสุขภาพ อยู่ที่ไหนก็ช็อปได้แค่ปลายนิ้ว กับ "Thai Organics shop" ', '', '', '', 'theme3', '2017-12-22 10:25:33', '2017-12-22 14:09:41', 'thaiorganics', '#000000', 'ธ.กรุงเทพ   บัญชีเลขที่  627-0-37643-4  ชื่อบัญชี ณัฐพล  กลั่นสกล\r\nธ.กสิกรไทย  บัญชีเลขที่  012-2-69494-1  ชื่อบัญชี Nattapon Klansakon\r\nธ.ทหารไทย  บัญชีเลขที่  523-2-45804-1  ชื่อบัญชี ณัฐพล  กลั่นสกล\r\nธ.กรุงไทย   บัญชีเลขที่  639-0-07082-9 ชื่อบัญชี ณัฐพล  กลั่นสกล\r\nธ.เพื่อการเกษตรฯ (ธกส.) 020-0-98012-153 ชื่อบัญชี ณัฐพล  กลั่นสกล'),
