(138, 812, 'ฟาร์มคุณทวด', 'ฟาร์มคุณทวด', '” มันวิเศษมากเลยนะครับที่เราใช้วัตถุดิบของฟาร์มเรา เราเห็นตั้งแต่เป็นเมล็ดที่เก็บพันธุ์มาเรื่อยๆ ดำนาลงดิน ต้นอ่อนโผ่พ้นน้ำรอดจากหอยเชอรี่และปูนาจนแตกกอ แบ่งปันเมล็ดพันธุ์บางส่วนให้นกหนูจนเก็บเกี่ยว สีข้าวแลัวปดเป็นแป้ง จนออกมาเป็นขนม”\r\n\r\nบนแพ็คเกจของฟาร์มคุณทวดจะเขียนไว้ว่า ” One organic seed from our homemade become to safe earth ”  เขียนไว้แบบนั้นเพราะทางฟาร์มอยากจะบอกกับเพื่อนๆที่รักว่า สิ่งที่ท่านกำลังสัมผัสจากเรานั้น เกิดจากวัตถุดิบที่ครั้งนึงเคยเป็นเมล็ดพันธุ์ที่ทางฟาร์มเก็บและต่อพันธุ์กว่า 5 ปี แปลความหมายก็คือท่านจะได้ทานขนมจากเมล็ดพันธุ์ข้าวที่ถูกถนุถนอมมาอย่างดีตลอด 5 ปี จนเป็นพันธุ์ที่ทางฟาร์มภาคภูมิใจที่จะส่งต่อให้ผู้บริโภค', '', '', '', 'theme1', '2018-05-06 13:41:08', '2018-05-06 13:41:08', 'khunthuadfarm', '#000000', 'ไทยพาณิชย์ : 187-216892-5      ชื่อบัญชี : นายกฤตวิทย์ วางขุนทด\r\nกสิกร        : 650-2-05409-9  ชื่อบัญชี : นายกฤตวิทย์ วางขุนทด\r\nกรุงไทย      : 984-5-89047-4   ชื่อบัญชี : นายกฤตวิทย์ วางขุนทด'),
