(143, 901, 'ชิดภิรมย์', 'ข้าวสังข์หยดเมืองพัทลุง', 'ข้าวสังหยดเมืองพัทลุงผลิตโดยกลุ่มเกษตรกรผู้ผลิตข้าวสังข์หยดเมืองพัทลุง ส่งมอบส่งดีๆให้ทุกคนได้ทานจากเกษตรกรโดยตรง ข้าวสังข์หยดเมืองพัทลุงเป็นข้าวโภชนาการสูง น้ำตาลแค่ .1% เหมาะสำหรับทานเพื่อควบคุมนำตาล', '', '', '', 'theme3', '2018-05-11 03:27:15', '2018-05-11 03:32:02', 'chidpirom', '#ffffff', 'ธ.กสิกรไทย 0223565603\r\nธ.กรุงไทย  1470211068\r\nธ.ทหารไทย 3462516133\r\nธ.ออมสิน   020237489198'),
